(1, 'Suzuki Liana', 'suzuki-liana-1', '<p class=\"MsoNormal\">The Suzuki Liana, also known as the Suzuki Aerio in some markets, is a compact sedan that offers a balance of affordability, reliability, and practicality. With its simple and understated design, the Liana focuses on functionality and efficiency. The Liana provides a comfortable and spacious interior, offering ample room for passengers and cargo. It is equipped with a range of features designed to enhance convenience and comfort, including power windows, air conditioning, and an audio system. The Liana\'s engine delivers decent performance and fuel efficiency, making it suitable for both city commuting and longer journeys. Suzuki\'s reputation for reliability ensures peace of mind for owners. With its affordable price point and dependable performance, the Suzuki Liana provides a practical transportation solution for those seeking a straightforward and reliable compact sedan.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Affordable and Practical Choice</li>\r\n<li class=\"MsoNormal\">Comfortable and Spacious Interior</li>\r\n<li class=\"MsoNormal\">Convenient Features for Enhanced Comfort</li>\r\n<li class=\"MsoNormal\">Decent Performance and Fuel Efficiency</li>\r\n<li class=\"MsoNormal\">Suzuki\'s Reputation for Reliability</li>\r\n</ul>\r\n<p>&nbsp;</p>', 260, 260, 13, 'Karakoram Rent a Car Services', '35.289247348340346', '75.62333657820903', 13, 1, '260,259,', 'https://youtu.be/tNrDgMQEPb8', '[{\"title\":\"When should I check the transmission fluid?\",\"content\":\"You should check the transmission fluid regularly. Try to check it at least once a month or at the sign of any trouble, for instance if there is any hesitation when you shift gears in an automatic.\"},{\"title\":\"How do I check the transmission fluid?\",\"content\":\"It\\u2019s not hard to check your transmission fluid if the vehicle is an automatic. This link to the Dummies guide to checking your transmission fluid has step-by-step instructions and illustrations that show you where to locate the dipstick. What you want is clear, pink transmission fluid. If it is low, top it up. If it is dark, smells burnt or has bits in it then you need to get it changed by at a reliable auto repair shop.\"},{\"title\":\"Is it really that important to check the transmission fluid?\",\"content\":\"Yes, it can be. Often times the symptoms you\\u2019ll experience from low or dirty transmission fluid will be the same as transmission problems. If you check the fluid levels regularly and refill as necessary then you\\u2019ll know if there are any symptoms of trouble that it\\u2019s not because the fluid levels are low and you need to see a mechanic.\"},{\"title\":\"Are there different types of transmission fluid?\",\"content\":\"How do I know what to buy? Yes, there are many different types of transmission fluid, each designed for a certain transmission. Different vehicles require different transmission fluids and the age of the car can also be a factor because newer transmissions take different types of transmission fluids than older vehicles. Don\\u2019t guess! Find out which type of transmission fluid is required for your vehicle by checking your owner\\u2019s manual.\"},{\"title\":\"What is a transmission flush and should I get one?\",\"content\":\"A transmission flush is used by some auto repair shops with the goal of flushing out debris.  Auto Tech does not do any sort of transmission flush.  Flushing an older transmission can cause harmful sediment to get stuck in the solenoids of the transmission. We heavily favor regular maintenance to lengthen the life of your transmission.  We service the transmission by changing fluid and the filter and do not recommend having your transmission flushed.\"},{\"title\":\"How do I know I have a fluid leak from the transmission?\",\"content\":\"Transmission fluid is slightly pink in color \\u2013 it will appear pink or red, or possibly more brownish if the transmission fluid is dirty and needs to be replaced. When you feel transmission fluid it will be slick and oily on your fingers. It smells much like oil unless it is dirty, in which case it will smell burnt. Usually transmission fluid leaks around the front or middle of your vehicle, so if you find puddles of reddish liquid there it is probably transmission fluid. Another clue is if in addition to the leak your transmission is not working well and you notice changes in the way it sounds when you shift gears, or if shifting gears is not working as well. In this case you likely have a leak of transmission fluid that is impacting how your transmission operates.\"}]', 2, '60.00', '35.00', 1, NULL, '[{\"name\":\"Child Toddler Seat\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Infant Child Seat\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"GPS Satellite\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"200\",\"type\":\"one_time\"}]', NULL, 5, 'Auto', 3, 4, 'publish', 1, 1, 1, NULL, '2023-06-24 00:08:00', '2023-07-14 05:28:05', '4.0', NULL, NULL, NULL, NULL, NULL),
(2, 'Toyota Passo', 'toyota-passo-1', '<p class=\"MsoNormal\">The Toyota Passo is a compact and stylish hatchback that offers a perfect combination of practicality, fuel efficiency, and comfort. With its sleek and modern design, the Passo stands out on the road, making a statement of sophistication and elegance. Designed primarily for urban driving, the Passo is nimble and agile, making it easy to navigate through tight city streets and crowded parking lots. Despite its compact size, the Passo provides a surprisingly spacious interior, with ample legroom and comfortable seating for both driver and passengers. The Passo is equipped with a fuel-efficient engine, delivering a smooth and economical driving experience. The advanced features and technology inside the cabin enhance convenience and connectivity. With its reputation for reliability and high build quality, the Toyota Passo offers a compelling choice for those seeking a compact hatchback that excels in practicality and comfort.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Sleek and Modern Design</li>\r\n<li class=\"MsoNormal\">Nimble and Agile for Urban Driving</li>\r\n<li class=\"MsoNormal\">Spacious Interior with Comfortable Seating</li>\r\n<li class=\"MsoNormal\">Fuel Efficiency for Economical Performance</li>\r\n<li class=\"MsoNormal\">Advanced Features and Technology for Convenience</li>\r\n</ul>', 258, 258, 12, 'Hadi tour', '34.911100093503336', '73.65546496553543', 13, 1, '257,', 'https://youtu.be/T339kL7w24o', '[{\"title\":\"When should I check the transmission fluid?\",\"content\":\"You should check the transmission fluid regularly. Try to check it at least once a month or at the sign of any trouble, for instance if there is any hesitation when you shift gears in an automatic.\"},{\"title\":\"How do I check the transmission fluid?\",\"content\":\"It\\u2019s not hard to check your transmission fluid if the vehicle is an automatic. This link to the Dummies guide to checking your transmission fluid has step-by-step instructions and illustrations that show you where to locate the dipstick. What you want is clear, pink transmission fluid. If it is low, top it up. If it is dark, smells burnt or has bits in it then you need to get it changed by at a reliable auto repair shop.\"},{\"title\":\"Is it really that important to check the transmission fluid?\",\"content\":\"Yes, it can be. Often times the symptoms you\\u2019ll experience from low or dirty transmission fluid will be the same as transmission problems. If you check the fluid levels regularly and refill as necessary then you\\u2019ll know if there are any symptoms of trouble that it\\u2019s not because the fluid levels are low and you need to see a mechanic.\"},{\"title\":\"Are there different types of transmission fluid?\",\"content\":\"How do I know what to buy? Yes, there are many different types of transmission fluid, each designed for a certain transmission. Different vehicles require different transmission fluids and the age of the car can also be a factor because newer transmissions take different types of transmission fluids than older vehicles. Don\\u2019t guess! Find out which type of transmission fluid is required for your vehicle by checking your owner\\u2019s manual.\"},{\"title\":\"What is a transmission flush and should I get one?\",\"content\":\"A transmission flush is used by some auto repair shops with the goal of flushing out debris.  Auto Tech does not do any sort of transmission flush.  Flushing an older transmission can cause harmful sediment to get stuck in the solenoids of the transmission. We heavily favor regular maintenance to lengthen the life of your transmission.  We service the transmission by changing fluid and the filter and do not recommend having your transmission flushed.\"},{\"title\":\"How do I know I have a fluid leak from the transmission?\",\"content\":\"Transmission fluid is slightly pink in color \\u2013 it will appear pink or red, or possibly more brownish if the transmission fluid is dirty and needs to be replaced. When you feel transmission fluid it will be slick and oily on your fingers. It smells much like oil unless it is dirty, in which case it will smell burnt. Usually transmission fluid leaks around the front or middle of your vehicle, so if you find puddles of reddish liquid there it is probably transmission fluid. Another clue is if in addition to the leak your transmission is not working well and you notice changes in the way it sounds when you shift gears, or if shifting gears is not working as well. In this case you likely have a leak of transmission fluid that is impacting how your transmission operates.\"}]', 2, '50.00', '40.00', 1, NULL, '[{\"name\":\"Child Toddler Seat\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Infant Child Seat\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"GPS Satellite\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"200\",\"type\":\"one_time\"}]', NULL, 6, 'Auto', 3, 4, 'publish', 1, 1, 1, NULL, '2023-06-24 00:08:00', '2023-07-14 05:28:28', '4.3', NULL, NULL, NULL, NULL, NULL),
(3, 'Suzuki Alto', 'suzuki-alto-2', '<p class=\"MsoNormal\">The Suzuki Alto 660CC is a compact and fuel-efficient hatchback that offers a perfect blend of affordability, practicality, and maneuverability. Designed for urban driving, the Alto 660CC excels in navigating through congested city streets and tight parking spaces. With its compact size, the Alto is easy to maneuver, making it an ideal choice for urban dwellers and first-time car owners. The 660CC engine delivers efficient performance, providing a balance between power and fuel economy. The Alto\'s interior is thoughtfully designed, offering comfortable seating and modern features for an enjoyable driving experience. Despite its small size, the Alto offers sufficient storage space for everyday essentials. With its affordability, low maintenance costs, and reliable performance, the Suzuki Alto 660CC remains a popular choice for those seeking an economical and practical hatchback.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Compact and Maneuverable Design</li>\r\n<li class=\"MsoNormal\">Fuel Efficiency for Economical Driving</li>\r\n<li class=\"MsoNormal\">Comfortable Interior with Modern Features</li>\r\n<li class=\"MsoNormal\">Ample Storage Space for Everyday Needs</li>\r\n<li class=\"MsoNormal\">Affordable and Low Maintenance Costs</li>\r\n</ul>', 229, 229, 11, 'Valleys On Wheels', '36.3201401503923', '74.67962192577947', 12, 1, '230,229,', 'https://youtu.be/l8oDz70S7H8', '[{\"title\":\"When should I check the transmission fluid?\",\"content\":\"You should check the transmission fluid regularly. Try to check it at least once a month or at the sign of any trouble, for instance if there is any hesitation when you shift gears in an automatic.\"},{\"title\":\"How do I check the transmission fluid?\",\"content\":\"It\\u2019s not hard to check your transmission fluid if the vehicle is an automatic. This link to the Dummies guide to checking your transmission fluid has step-by-step instructions 