needs to be replaced. When you feel transmission fluid it will be slick and oily on your fingers. It smells much like oil unless it is dirty, in which case it will smell burnt. Usually transmission fluid leaks around the front or middle of your vehicle, so if you find puddles of reddish liquid there it is probably transmission fluid. Another clue is if in addition to the leak your transmission is not working well and you notice changes in the way it sounds when you shift gears, or if shifting gears is not working as well. In this case you likely have a leak of transmission fluid that is impacting how your transmission operates.\"}]', 4, '50.00', '0.00', 1, 1, '[{\"name\":\"Child Toddler Seat\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"5\",\"type\":\"one_time\"},{\"name\":\"Infant Child Seat\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"5\",\"type\":\"one_time\"},{\"name\":\"GPS Satellite\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"5\",\"type\":\"one_time\"}]', NULL, 5, 'Auto', 4, 4, 'publish', 1, 1, 1, NULL, '2023-06-24 00:08:00', '2023-07-14 05:29:43', '4.8', NULL, NULL, NULL, NULL, NULL),
