(10, 'Toyota Prius Plus', 'toyota-prius-plus', '<p class=\"MsoNormal\">The Toyota Prius is a trailblazing hybrid vehicle that has revolutionized the automotive landscape with its groundbreaking technology, remarkable fuel efficiency, and commitment to sustainability. With its sleek and aerodynamic design, the Prius stands out as a symbol of eco-consciousness and innovation. Its hybrid powertrain seamlessly blends a gasoline engine and an electric motor, providing impressive fuel economy and reduced emissions. The Prius offers a comfortable and spacious interior, equipped with advanced features and cutting-edge infotainment systems. With its exceptional fuel efficiency, environmental friendliness, and forward-thinking design, the Toyota Prius continues to lead the way in the hybrid vehicle segment.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Cutting-Edge Hybrid Technology</li>\r\n<li class=\"MsoNormal\">Remarkable Fuel Efficiency</li>\r\n<li class=\"MsoNormal\">Striking and Aerodynamic Design</li>\r\n<li class=\"MsoNormal\">Comfortable and Spacious Interior</li>\r\n<li class=\"MsoNormal\">Advanced Features and Infotainment Systems</li>\r\n</ul>', 254, 254, 13, 'Skardu rent a car service', '35.293106996960574', '75.62408344570586', 12, NULL, '253,', 'https://youtu.be/GC0nTBC-Jvs', '[{\"title\":\"When should I check the transmission fluid?\",\"content\":\"You should check the transmission fluid regularly. Try to check it at least once a month or at the sign of any trouble, for instance if there is any hesitation when you shift gears in an automatic.\"},{\"title\":\"How do I check the transmission fluid?\",\"content\":\"It\\u2019s not hard to check your transmission fluid if the vehicle is an automatic. This link to the Dummies guide to checking your transmission fluid has step-by-step instructions and illustrations that show you where to locate the dipstick. What you want is clear, pink transmission fluid. If it is low, top it up. If it is dark, smells burnt or has bits in it then you need to get it changed by at a reliable auto repair shop.\"},{\"title\":\"Is it really that important to check the transmission fluid?\",\"content\":\"Yes, it can be. Often times the symptoms you\\u2019ll experience from low or dirty transmission fluid will be the same as transmission problems. If you check the fluid levels regularly and refill as necessary then you\\u2019ll know if there are any symptoms of trouble that it\\u2019s not because the fluid levels are low and you need to see a mechanic.\"},{\"title\":\"Are there different types of transmission fluid?\",\"content\":\"How do I know what to buy? Yes, there are many different types of transmission fluid, each designed for a certain transmission. Different vehicles require different transmission fluids and the age of the car can also be a factor because newer transmissions take different types of transmission fluids than older vehicles. Don\\u2019t guess! Find out which type of transmission fluid is required for your vehicle by checking your owner\\u2019s manual.\"},{\"title\":\"What is a transmission flush and should I get one?\",\"content\":\"A transmission flush is used by some auto repair shops with the goal of flushing out debris.  Auto Tech does not do any sort of transmission flush.  Flushing an older transmission can cause harmful sediment to get stuck in the solenoids of the transmission. We heavily favor regular maintenance to lengthen the life of your transmission.  We service the transmission by changing fluid and the filter and do not recommend having your transmission flushed.\"},{\"title\":\"How do I know I have a fluid leak from the transmission?\",\"content\":\"Transmission fluid is slightly pink in color \\u2013 it will appear pink or red, or possibly more brownish if the transmission fluid is dirty and needs to be replaced. When you feel transmission fluid it will be slick and oily on your fingers. It smells much like oil unless it is dirty, in which case it will smell burnt. Usually transmission fluid leaks around the front or middle of your vehicle, so if you find puddles of reddish liquid there it is probably transmission fluid. Another clue is if in addition to the leak your transmission is not working well and you notice changes in the way it sounds when you shift gears, or if shifting gears is not working as well. In this case you likely have a leak of transmission fluid that is impacting how your transmission operates.\"}]', 1, '60.00', '0.00', 1, NULL, '[{\"name\":\"Child Toddler Seat\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Infant Child Seat\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"GPS Satellite\",\"name_ja\":null,\"name_egy\":null,\"name_de\":null,\"name_es\":null,\"price\":\"200\",\"type\":\"one_time\"}]', NULL, 5, 'Auto', 9, 4, 'publish', 1, 6, 1, NULL, '2023-06-24 00:08:00', '2023-06-24 11:16:20', '4.0', NULL, NULL, NULL, NULL, NULL),
