(14, 'Honda Civic RS Turbo 2023', 'honda-civic-rs-turbo-2023', '<p class=\"MsoNormal\">The Honda Civic 2023 is a sleek and modern compact car that combines style, performance, and fuel efficiency. With its bold exterior design, comfortable and spacious interior, and a range of advanced safety features, the Civic offers a practical and enjoyable driving experience. It is equipped with various engine options that balance power and efficiency, while its user-friendly infotainment system keeps you connected on the road. With a focus on fuel economy and a reputation for reliability, the Civic 2023 is an excellent choice for those seeking a stylish and dependable compact car.</p>', 246, 246, 14, 'Neelum Motors Rent A Car', '34.37352582519234', '73.46945821874671', 10, NULL, '269,', 'https://youtu.be/ODN00DfEK-U', NULL, 2, '50.00', NULL, NULL, NULL, NULL, NULL, 6, 'Auto', 3, 4, 'publish', 0, 1, 1, NULL, '2023-06-28 02:21:15', '2023-06-28 04:22:19', NULL, NULL, NULL, NULL, NULL, NULL),
