(17, 'Jeep Commandar', 'jeep-commandar', '<p class=\"MsoNormal\">The Jeep Commander is a rugged and versatile SUV that combines off-road capability with luxurious comfort, making it an ideal choice for adventurous individuals and families. With its commanding presence and robust design, the Commander exudes confidence on and off the beaten path. Its spacious interior offers seating for up to seven passengers, providing ample room for both passengers and cargo. The Jeep Commander boasts impressive off-road capabilities, thanks to its advanced four-wheel-drive systems and available features like hill descent control and off-road suspension. On the inside, the Commander offers a host of modern amenities and advanced safety features, ensuring a comfortable and secure ride. With its blend of capability, versatility, and comfort, the Jeep Commander stands tall as a true SUV that can tackle any terrain with style.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Robust Off-Road Capability</li>\r\n<li class=\"MsoNormal\">Spacious and Versatile Interior</li>\r\n<li class=\"MsoNormal\">Advanced Four-Wheel-Drive Systems</li>\r\n<li class=\"MsoNormal\">Modern Amenities and Comfort Features</li>\r\n<li class=\"MsoNormal\">Enhanced Safety Features</li>\r\n</ul>\r\n<p>&nbsp;</p>', 239, 239, 16, 'Samir Ahmad rent a car', '35.85583212925646', '71.78548618069067', 12, 1, '245,', 'https://youtu.be/pl7IJPoLpT0', NULL, 2, '70.00', NULL, NULL, NULL, NULL, NULL, 7, 'Manual', 4, 2, 'publish', 1, 15, 1, NULL, '2023-06-28 02:32:15', '2023-06-28 02:32:15', NULL, NULL, NULL, NULL, NULL, NULL),
(18, 'Suzuki Alto', 'suzuki-alto', '<p class=\"MsoNormal\">The Suzuki Alto 660CC is a compact and fuel-efficient hatchback that offers a perfect blend of affordability, practicality, and maneuverability. Designed for urban driving, the Alto 660CC excels in navigating through congested city streets and tight parking spaces. With its compact size, the Alto is easy to maneuver, making it an ideal choice for urban dwellers and first-time car owners. The 660CC engine delivers efficient performance, providing a balance between power and fuel economy. The Alto\'s interior is thoughtfully designed, offering comfortable seating and modern features for an enjoyable driving experience. Despite its small size, the Alto offers sufficient storage space for everyday essentials. With its affordability, low maintenance costs, and reliable performance, the Suzuki Alto 660CC remains a popular choice for those seeking an economical and practical hatchback.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Compact and Maneuverable Design</li>\r\n<li class=\"MsoNormal\">Fuel Efficiency for Economical Driving</li>\r\n<li class=\"MsoNormal\">Comfortable Interior with Modern Features</li>\r\n<li class=\"MsoNormal\">Ample Storage Space for Everyday Needs</li>\r\n<li class=\"MsoNormal\">Affordable and Low Maintenance Costs</li>\r\n</ul>', 229, 229, 17, 'Al-Basit Rent a car Murree', '33.90794992938127', '73.39718889795999', 12, NULL, '230,', 'https://youtu.be/l8oDz70S7H8', NULL, 1, '30.00', NULL, NULL, NULL, NULL, NULL, 5, 'Manual', 2, 4, 'publish', 1, 5, 1, NULL, '2023-06-28 02:35:29', '2023-06-28 02:35:29', NULL, NULL, NULL, NULL, NULL, NULL),
(19, 'MG HS', '7339718889795999', '<p class=\"MsoNormal\">The MG HS is a stylish and contemporary SUV that combines sleek design, advanced technology, and practicality. With its modern aesthetics and attention to detail, the HS stands out as a premium offering in the SUV segment. Its sleek lines and bold front grille create a striking presence on the road. Inside, the HS offers a spacious and comfortable cabin, with high-quality materials and thoughtful features enhancing the overall driving experience. The HS is equipped with advanced safety features, including driver-assistance systems, to provide peace of mind on every journey. In terms of performance, the HS offers a range of efficient engines, delivering a balance between power and fuel economy. With its combination of style, technology, and practicality, the MG HS offers a compelling choice for those seeking a versatile and contemporary SUV.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Sleek and Contemporary Design</li>\r\n<li class=\"MsoNormal\">Spacious and Comfortable Cabin</li>\r\n<li class=\"MsoNormal\">Advanced Safety Features</li>\r\n<li class=\"MsoNormal\">Efficient Performance</li>\r\n<li class=\"MsoNormal\">Modern Technology and Connectivity</li>\r\n</ul>\r\n<p>&nbsp;</p>', 237, 237, 14, 'Neelum Motors Rent A Car', '34.37352582519234', '73.46945821874671', 12, NULL, '237,237,', 'https://youtube.com/shorts/agWuMGRslaM?feature=share', NULL, 3, '40.00', NULL, NULL, NULL, NULL, NULL, 6, 'Auto', 3, 4, 'publish', 1, 12, 1, NULL, '2023-06-28 02:46:18', '2023-06-28 02:46:49', NULL, NULL, NULL, NULL, NULL, NULL),
(20, 'Suzuki Liana', 'suzuki-liana', '<p class=\"MsoNormal\">The Suzuki Liana, also known as the Suzuki Aerio in some markets, is a compact sedan that offers a balance of affordability, reliability, and practicality. With its simple and understated design, the Liana focuses on functionality and efficiency. The Liana provides a comfortable and spacious interior, offering ample room for passengers and cargo. It is equipped with a range of features designed to enhance convenience and comfort, including power windows, air conditioning, and an audio system. The Liana\'s engine delivers decent performance and fuel efficiency, making it suitable for both city commuting and longer journeys. Suzuki\'s reputation for reliability ensures peace of mind for owners. With its affordable price point and dependable performance, the Suzuki Liana provides a practical transportation solution for those seeking a straightforward and reliable compact sedan.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Affordable and Practical Choice</li>\r\n<li class=\"MsoNormal\">Comfortable and Spacious Interior</li>\r\n<li class=\"MsoNormal\">Convenient Features for Enhanced Comfort</li>\r\n<li class=\"MsoNormal\">Decent Performance and Fuel Efficiency</li>\r\n<li class=\"MsoNormal\">Suzuki\'s Reputation for Reliability</li>\r\n</ul>\r\n<p>&nbsp;</p>', 259, 260, 18, 'Karachi Rent A Car Service', '24.90737720600665', '67.04037400939961', 10, NULL, '259,', 'https://youtu.be/tNrDgMQEPb8', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 5, 'Manual', 3, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 02:53:48', '2023-06-28 02:53:48', NULL, NULL, NULL, NULL, NULL, NULL),
(21, 'Toyota Passo', 'toyota-passo', '<p class=\"MsoNormal\">The Toyota Passo is a compact and stylish hatchback that offers a perfect combination of practicality, fuel efficiency, and comfort. With its sleek and modern design, the Passo stands out on the road, making a statement of sophistication and elegance. Designed primarily for urban driving, the Passo is nimble and agile, making it easy to navigate through tight city streets and crowded parking lots. Despite its compact size, the Passo provides a surprisingly spacious interior, with ample legroom and comfortable seating for both driver and passengers. The Passo is equipped with a fuel-efficient engine, delivering a smooth and economical driving experience. The advanced features and technology inside the cabin enhance convenience and connectivity. With its reputation for reliability and high build quality, the Toyota Passo offers a compelling choice for those seeking a compact hatchback that excels in practicality and comfort.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Sleek and Modern Design</li>\r\n<li class=\"MsoNormal\">Nimble and Agile for Urban Driving</li>\r\n<li class=\"MsoNormal\">Spacious Interior with Comfortable Seating</li>\r\n<li class=\"MsoNormal\">Fuel Efficiency for Economical Performance</li>\r\n<li class=\"MsoNormal\">Advanced Features and Technology for Convenience</li>\r\n</ul>', 258, 258, 18, 'Karachi Rent A Car Service', '24.90737720600665', '67.04037400939961', 8, NULL, '257,', 'https://youtu.be/T339kL7w24o', NULL, 3, '34.00', NULL, NULL, NULL, NULL, NULL, 5, 'Auto', 3, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 02:56:56', '2023-06-28 02:56:56', NULL, NULL, NULL, NULL, NULL, NULL),
(22, 'KIA Sportage AWD', 'kia-sportage-awd-1', '<p><span style=\"color: #374151; font-family: S&ouml;hne, ui-sans-serif, system-ui, -apple-system, \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\'; font-size: 16px; white-space-collapse: preserve; background-color: #f7f7f8;\">The Kia Sportage is a dynamic and stylish compact SUV that boasts a range of impressive features, making it a popular choice among drivers. With its eye-catching design and exceptional performance, the Sportage stands out in the crowded SUV market. Here are some of its key highlights:</span></p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li>Striking Exterior</li>\r\n<li>Spacious and Comfortable Cabin</li>\r\n<li>Advanced Technology</li>\r\n<li>Dynamic Performance</li>\r\n<li>Comprehensive Safety</li>\r\n</ul>', 240, 240, 19, 'Lahori Rent A Car', '31.47520782147201', '74.2903915000625', 10, NULL, '241,', 'https://youtu.be/k2ANKbKFIds', NULL, 2, '30.00', NULL, NULL, NULL, NULL, NULL, 5, 'Manual', 3, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 03:00:15', '2023-06-28 03:00:15', NULL, NULL, NULL, NULL, NULL, NULL),
(23, 'Toyota Prius Plus', 'toyota-prius-plus-1', '<p class=\"MsoNormal\">The Toyota Prius is a trailblazing hybrid vehicle that has revolutionized the automotive landscape with its groundbreaking technology, remarkable fuel efficiency, and commitment to sustainability. With its sleek and aerodynamic design, the Prius stands out as a symbol of eco-consciousness and innovation. Its hybrid powertrain seamlessly blends a gasoline engine and an electric motor, providing impressive fuel economy and reduced emissions. The Prius offers a comfortable and spacious interior, equipped with advanced features and cutting-edge infotainment systems. With its exceptional fuel efficiency, environmental friendliness, and forward-thinking design, the Toyota Prius continues to lead the way in the hybrid vehicle segment.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Cutting-Edge Hybrid Technology</li>\r\n<li class=\"MsoNormal\">Remarkable Fuel Efficiency</li>\r\n<li class=\"MsoNormal\">Striking and Aerodynamic Design</li>\r\n<li class=\"MsoNormal\">Comfortable and Spacious Interior</li>\r\n<li class=\"MsoNormal\">Advanced Features and Infotainment Systems</li>\r\n</ul>', 254, 254, 19, 'Lahori Rent a Car', '31.47520782147201', '74.2903915000625', 8, NULL, '253,', 'https://youtu.be/GC0nTBC-Jvs', NULL, 0, '70.00', NULL, NULL, NULL, NULL, NULL, 4, 'Manual', 3, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 03:03:28', '2023-06-28 03:22:45', NULL, NULL, NULL, NULL, NULL, NULL),
(24, 'Toyota Prado', 'toyota-prado', '<p class=\"MsoNormal\">The Toyota Prado is a renowned SUV that straikes a perfect balance between rugged off-road capability and refined luxury. With its iconic design and powerful performance, the Prado is an ideal choice for those seeking adventure without compromising on comfort. Its muscular stance and bold lines exude strength and presence on the road. The Prado offers a spacious and well-appointed interior, providing ample room for passengers and cargo, making it suitable for both family trips and off-road expeditions. Equipped with advanced four-wheel-drive systems, the Prado conquers challenging terrains with ease, while its comfortable ride and sophisticated features ensure a smooth and enjoyable driving experience. With its reputation for reliability and durability, the Toyota Prado remains a top choice for those who crave the thrill of exploration without sacrificing luxury and comfort.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\" style=\"line-height: normal;\">Powerful Off-Road Capability</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal;\">Spacious and Comfortable Interior</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal;\">Iconic and Muscular Design</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal;\">Advanced Four-Wheel-Drive Systems</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal;\">Reliable and Durable Performance</li>\r\n</ul>\r\n<p>&nbsp;</p>', 242, 242, 20, 'Faisalabad rent a car', '31.44430328403078', '73.12702153977962', 10, NULL, '242,', 'https://youtu.be/m12A34xgAQg', NULL, 2, '30.00', NULL, NULL, NULL, NULL, NULL, 5, 'Auto', 3, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 03:07:05', '2023-06-28 03:07:05', NULL, NULL, NULL, NULL, NULL, NULL),
(25, 'Toyota Hiace', 'toyota-hiace', '<p class=\"MsoNormal\">The Toyota Hiace is a legendary and versatile van that has earned a reputation for its reliability, durability, and practicality. With its spacious interior, robust build, and efficient performance, the Hiace has become a preferred choice for businesses, families, and commercial operators alike. The Hiace offers various seating configurations and ample cargo space, making it ideal for transporting passengers or carrying goods. Its strong and sturdy construction ensures a smooth and comfortable ride, while its efficient engines deliver power and fuel efficiency. The Hiace is equipped with modern features and safety technologies to enhance convenience and provide a secure driving experience. With its proven track record and timeless design, the Toyota Hiace continues to be a trusted companion for those in need of a dependable and versatile van.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Reliable and Durable Performance</li>\r\n<li class=\"MsoNormal\">Spacious Interior and Flexible Seating Configurations</li>\r\n<li class=\"MsoNormal\">Efficient Engines for Power and Fuel Efficiency</li>\r\n<li class=\"MsoNormal\">Modern Features and Safety Technologies</li>\r\n<li class=\"MsoNormal\">Trusted and Timeless Design</li>\r\n</ul>\r\n<p>&nbsp;</p>', 236, 236, 20, 'Faisalabad rent a car', '31.44430328403078', '73.12702153977962', 10, 1, '235,', 'https://youtu.be/2Ldt4H1VBwY', NULL, 3, '30.00', NULL, NULL, NULL, NULL, NULL, 13, 'Manual', 4, 2, 'publish', 1, 1, 1, NULL, '2023-06-28 03:09:54', '2023-06-28 03:09:54', NULL, NULL, NULL, NULL, NULL, NULL),
(26, 'Toyota Corolla GLI', 'toyota-corolla-gli', '<p class=\"MsoNormal\">The Toyota Corolla GLI is a popular and well-rounded sedan that combines reliability, comfort, and practicality. As a part of the iconic Corolla lineup, the GLI model delivers a balance of performance and efficiency, making it a trusted choice for daily commuting and family transportation. With its sleek and aerodynamic design, the Corolla GLI exudes a modern and sophisticated appeal. The interior offers a spacious and comfortable cabin, featuring high-quality materials and intuitive controls. The GLI is equipped with a dependable engine, providing smooth acceleration and impressive fuel economy. Safety is prioritized with features like multiple airbags, anti-lock braking system, and stability control. With its reputation for longevity and resale value, the Toyota Corolla GLI ensures a reliable and enjoyable driving experience for those seeking a practical and stylish sedan.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Reliable and Efficient Performance</li>\r\n<li class=\"MsoNormal\">Sleek and Modern Design</li>\r\n<li class=\"MsoNormal\">Spacious and Comfortable Interior</li>\r\n<li class=\"MsoNormal\">Advanced Safety Features</li>\r\n<li class=\"MsoNormal\">Strong Resale Value and Longevity</li>\r\n</ul>\r\n<p>&nbsp;</p>', 234, 233, 21, 'Peshawar Rent A Car Service', '33.97753394850238', '71.48518993525123', 10, 1, '234,', 'https://youtu.be/GCweEB0p6Yk', NULL, 2, '50.00', NULL, NULL, NULL, NULL, NULL, 5, 'Auto', 2, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 03:13:45', '2023-06-28 03:13:45', NULL, NULL, NULL, NULL, NULL, NULL),
(27, 'Suzuki Bolan', 'suzuki-bolan', '<p class=\"MsoNormal\">The Suzuki Bolan, also known as Suzuki Carry or Suzuki Every, is a versatile and practical minivan that has become a popular choice for commercial purposes and family transportation. With its compact size and functional design, the Bolan offers convenience and efficiency in urban environments. The Bolan features a spacious interior that can accommodate a significant number of passengers or be configured for cargo transportation. Its compact dimensions make it easy to maneuver through tight city streets and park in crowded areas. The Bolan is equipped with a reliable engine that delivers decent performance and fuel efficiency. While its design may be simple, the Bolan focuses on utility, reliability, and affordability. With its widespread availability of spare parts and a trusted reputation, the Suzuki Bolan continues to serve as a practical and economical choice for those in need of a dependable minivan.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Compact and Functional Design</li>\r\n<li class=\"MsoNormal\">Spacious Interior for Passengers or Cargo</li>\r\n<li class=\"MsoNormal\">Maneuverability in Urban Environments</li>\r\n<li class=\"MsoNormal\">Reliable Engine Performance</li>\r\n<li class=\"MsoNormal\">Affordable and Practical Transportation Solution</li>\r\n</ul>', 228, 228, 21, 'Peshawar Rent A Car Service', '33.97753394850238', '71.48518993525123', 10, 1, '232,', 'https://youtu.be/qlJqqZBRPho', NULL, 3, '35.00', NULL, NULL, NULL, NULL, NULL, 12, 'Manual', 5, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 03:16:32', '2023-06-28 03:16:32', NULL, NULL, NULL, NULL, NULL, NULL),
