(32, 'Suzuki Bolan', 'suzuki-bolan-1', '<p class=\"MsoNormal\">The Suzuki Bolan, also known as Suzuki Carry or Suzuki Every, is a versatile and practical minivan that has become a popular choice for commercial purposes and family transportation. With its compact size and functional design, the Bolan offers convenience and efficiency in urban environments. The Bolan features a spacious interior that can accommodate a significant number of passengers or be configured for cargo transportation. Its compact dimensions make it easy to maneuver through tight city streets and park in crowded areas. The Bolan is equipped with a reliable engine that delivers decent performance and fuel efficiency. While its design may be simple, the Bolan focuses on utility, reliability, and affordability. With its widespread availability of spare parts and a trusted reputation, the Suzuki Bolan continues to serve as a practical and economical choice for those in need of a dependable minivan.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Compact and Functional Design</li>\r\n<li class=\"MsoNormal\">Spacious Interior for Passengers or Cargo</li>\r\n<li class=\"MsoNormal\">Maneuverability in Urban Environments</li>\r\n<li class=\"MsoNormal\">Reliable Engine Performance</li>\r\n<li class=\"MsoNormal\">Affordable and Practical Transportation Solution</li>\r\n</ul>', 228, 228, 24, 'Kashmir Car Rentals', '34.14402358589674', '74.84955640815569', 10, 1, '232,', 'https://youtu.be/qlJqqZBRPho', NULL, 2, '30.00', NULL, NULL, NULL, NULL, NULL, 12, 'Manual', 3, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 03:57:46', '2023-06-28 03:57:46', NULL, NULL, NULL, NULL, NULL, NULL);
