(33, 'Toyota Prado', 'toyota-prado-1', '<p class=\"MsoNormal\">The Toyota Prado is a renowned SUV that strikes a perfect balance between rugged off-road capability and refined luxury. With its iconic design and powerful performance, the Prado is an ideal choice for those seeking adventure without compromising on comfort. Its muscular stance and bold lines exude strength and presence on the road. The Prado offers a spacious and well-appointed interior, providing ample room for passengers and cargo, making it suitable for both family trips and off-road expeditions. Equipped with advanced four-wheel-drive systems, the Prado conquers challenging terrains with ease, while its comfortable ride and sophisticated features ensure a smooth and enjoyable driving experience. With its reputation for reliability and durability, the Toyota Prado remains a top choice for those who crave the thrill of exploration without sacrificing luxury and comfort.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\" style=\"line-height: normal;\">Powerful Off-Road Capability</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal;\">Spacious and Comfortable Interior</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal;\">Iconic and Muscular Design</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal;\">Advanced Four-Wheel-Drive Systems</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal;\">Reliable and Durable Performance</li>\r\n</ul>\r\n<p>&nbsp;</p>', 242, 242, 24, 'Kashmir Car Rentals', '34.14402358589674', '74.84955640815569', 8, NULL, NULL, 'https://youtu.be/m12A34xgAQg', NULL, 1, '70.00', NULL, NULL, NULL, NULL, NULL, 5, 'Manual', 4, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 04:01:33', '2023-06-28 04:18:34', NULL, NULL, NULL, NULL, NULL, NULL),
(34, 'Jeep Commandar', 'jeep-commandar-1', '<p class=\"MsoNormal\">The Jeep Commander is a rugged and versatile SUV that combines off-road capability with luxurious comfort, making it an ideal choice for adventurous individuals and families. With its commanding presence and robust design, the Commander exudes confidence on and off the beaten path. Its spacious interior offers seating for up to seven passengers, providing ample room for both passengers and cargo. The Jeep Commander boasts impressive off-road capabilities, thanks to its advanced four-wheel-drive systems and available features like hill descent control and off-road suspension. On the inside, the Commander offers a host of modern amenities and advanced safety features, ensuring a comfortable and secure ride. With its blend of capability, versatility, and comfort, the Jeep Commander stands tall as a true SUV that can tackle any terrain with style.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Robust Off-Road Capability</li>\r\n<li class=\"MsoNormal\">Spacious and Versatile Interior</li>\r\n<li class=\"MsoNormal\">Advanced Four-Wheel-Drive Systems</li>\r\n<li class=\"MsoNormal\">Modern Amenities and Comfort Features</li>\r\n<li class=\"MsoNormal\">Enhanced Safety Features</li>\r\n</ul>\r\n<p>&nbsp;</p>', 245, 245, 24, 'Kashmir Car Rentals', '34.14402358589674', '74.84955640815569', 10, NULL, '239,', 'https://youtu.be/pl7IJPoLpT0', NULL, 2, '100.00', NULL, NULL, NULL, NULL, NULL, 6, 'Manual', 2, 2, 'publish', 1, 1, 1, NULL, '2023-06-28 04:04:42', '2023-06-28 04:17:54', NULL, NULL, NULL, NULL, NULL, NULL),
(35, 'Suzuki Wagon R', 'suzuki-wagon-r-1', '<p class=\"MsoNormal\">The Suzuki Wagon R is a compact and practical car that combines functionality with style. With its distinctive design, the Wagon R offers a spacious and versatile interior, providing ample room for passengers and cargo. Its compact size makes it maneuverable in urban environments, while the tall roofline ensures generous headroom. The Wagon R is known for its fuel efficiency and reliable performance, making it an ideal choice for city commuting and long drives. Equipped with innovative features and technology, such as a touchscreen infotainment system and advanced safety systems, the Wagon R offers convenience and peace of mind. With its trusted reliability and safety, the Suzuki Wagon R continues to be a popular choice for those seeking practicality and comfort in a compact car.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li>Compact and Practical Design</li>\r\n<li>Versatile and Spacious Interior</li>\r\n<li>Fuel Efficiency and Performance</li>\r\n<li>Innovative Features and Technology</li>\r\n<li>Trusted Reliability and Safety</li>\r\n</ul>', 244, 243, 25, 'Shahzad Rent a Car', '29.391947875605123', '71.71084258849181', 10, NULL, '244,', 'https://youtu.be/sHADHt2JNfg', NULL, 1, '40.00', NULL, NULL, NULL, NULL, NULL, 5, 'Manual', 2, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 04:11:41', '2023-06-28 04:11:41', NULL, NULL, NULL, NULL, NULL, NULL),
(36, 'Suzuki Alto', 'suzuki-alto-1', '<p class=\"MsoNormal\">The Suzuki Alto 660CC is a compact and fuel-efficient hatchback that offers a perfect blend of affordability, practicality, and maneuverability. Designed for urban driving, the Alto 660CC excels in navigating through congested city streets and tight parking spaces. With its compact size, the Alto is easy to maneuver, making it an ideal choice for urban dwellers and first-time car owners. The 660CC engine delivers efficient performance, providing a balance between power and fuel economy. The Alto\'s interior is thoughtfully designed, offering comfortable seating and modern features for an enjoyable driving experience. Despite its small size, the Alto offers sufficient storage space for everyday essentials. With its affordability, low maintenance costs, and reliable performance, the Suzuki Alto 660CC remains a popular choice for those seeking an economical and practical hatchback.</p>\r\n<h4>HIGHLIGHTS</h4>\r\n<ul>\r\n<li class=\"MsoNormal\">Compact and Maneuverable Design</li>\r\n<li class=\"MsoNormal\">Fuel Efficiency for Economical Driving</li>\r\n<li class=\"MsoNormal\">Comfortable Interior with Modern Features</li>\r\n<li class=\"MsoNormal\">Ample Storage Space for Everyday Needs</li>\r\n<li class=\"MsoNormal\">Affordable and Low Maintenance Costs</li>\r\n</ul>', 230, 230, 25, 'Shahzad Rent a Car', '29.391947875605123', '71.71084258849181', 8, 1, '229,', 'https://youtu.be/l8oDz70S7H8', NULL, 2, '30.00', NULL, NULL, NULL, NULL, NULL, 4, 'Auto', 2, 4, 'publish', 1, 1, 1, NULL, '2023-06-28 04:15:55', '2023-06-28 04:15:55', NULL, NULL, NULL, NULL, NULL, NULL);
