(1, 'Islamabad', '<p>New York, a city that doesnt sleep, as Frank Sinatra sang. The Big Apple is one of the largest cities in the United States and one of the most popular in the whole country and the world. Millions of tourists visit it every year attracted by its various iconic symbols and its wide range of leisure and cultural offer. New York is the birth place of new trends and developments in many fields such as art, gastronomy, technology,...</p>', 'paris', 247, '33.7294', '73.0395', 12, 'publish', 1, 2, NULL, 1, 1, '2023-06-24 08:27:04', NULL, NULL, '2023-06-24 00:07:46', '2023-06-24 08:27:04', 247, '[{\"image_id\":\"247\",\"title\":\"Experiencing the best jazz in Harlem, birthplace of bebop\",\"link\":\"#\",\"content\":\"New Orleans might be the home of jazz, but New York City is where many of the genre\\u2019s greats became stars \\u2013 and Harlem was at the heart of it.The neighborhood experienced a rebirth during the...\"}]'),
