(9, 'Islambad', NULL, 'islambad', 247, NULL, NULL, 8, 'publish', 14, 15, 7, 1, 1, '2023-06-24 08:20:11', NULL, NULL, '2023-06-24 08:00:12', '2023-06-24 08:20:11', 247, NULL),
(10, 'Islamabad', '<p><span style=\"color: #374151; font-family: S&ouml;hne, ui-sans-serif, system-ui, -apple-system, \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\'; font-size: 16px; white-space-collapse: preserve; background-color: #f7f7f8;\">Nestled amidst the picturesque Margalla Hills, Islamabad, the capital city of Pakistan, is a modern metropolis that harmoniously combines natural beauty with urban development. Known for its clean streets, well-organized infrastructure, and serene atmosphere, Islamabad offers a tranquil environment surrounded by lush greenery. It serves as the political and diplomatic hub of the country, housing government institutions and foreign embassies. The city also boasts renowned educational institutions, a vibrant cultural scene, and a high standard of living, making it a desirable place to reside. With its scenic setting, modern amenities, and cosmopolitan character, Islamabad stands as a testament to a well-planned and thriving capital city.</span></p>', 'islamabad', 247, '33.7294', '73.0395', 12, 'publish', 19, 20, NULL, 1, 1, NULL, NULL, NULL, '2023-06-24 08:26:13', '2023-06-24 08:29:37', 247, NULL),
(11, 'Hunza', '<p><span style=\"color: #374151; font-family: S&ouml;hne, ui-sans-serif, system-ui, -apple-system, \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\'; font-size: 16px; white-space-collapse: preserve; background-color: #f7f7f8;\">Hunza Valley is a captivating destination in Pakistan\'s Gilgit-Baltistan region, characterized by its awe-inspiring landscapes, rich cultural heritage, pristine alpine lakes, and opportunities for trekking and adventure. Nestled amidst the Karakoram Mountain range, the valley offers breathtaking views of snow-capped peaks, lush green valleys, and cascading waterfalls. The local Hunzakuts warmly embrace visitors, sharing their unique traditions and customs. With historical forts, such as Baltit and Altit Fort, and stunning lakes like Attabad and Borith, Hunza Valley provides an unforgettable experience where nature, culture, and adventure seamlessly intertwine.</span></p>', 'hunza', 248, '36.323104934271306', '74.66986781932093', 15, 'publish', 21, 22, NULL, 1, 1, NULL, NULL, NULL, '2023-06-24 08:33:11', '2023-06-24 09:50:15', 248, NULL),
(12, 'Naran Kaghan', '<p><span style=\"color: #374151; font-family: S&ouml;hne, ui-sans-serif, system-ui, -apple-system, \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\'; font-size: 16px; white-space-collapse: preserve; background-color: #f7f7f8;\">Naran Kaghan, nestled in the scenic Kaghan Valley of Pakistan, is a mesmerizing destination that captivates visitors with its pristine beauty and tranquil charm. Surrounded by the mighty Himalayas, the region is blessed with snow-capped peaks, lush green meadows, gushing rivers, and crystal-clear lakes. The journey to Naran Kaghan is a feast for the senses, with picturesque landscapes unfolding at every turn. From the majestic Saif-ul-Malook Lake to the enchanting Lalazar Plateau and the breathtaking Babusar Pass, the area offers a plethora of natural wonders to explore. Trekking, camping, and fishing are popular activities, allowing visitors to immerse themselves in the untouched wilderness. Naran Kaghan truly embodies the serenity and grandeur of nature, making it a cherished destination for those seeking tranquility and natural splendor.</span></p>', 'naran-kaghan', 251, '34.9093', '73.6507', 12, 'publish', 23, 24, NULL, 1, 1, NULL, NULL, NULL, '2023-06-24 09:53:46', '2023-06-24 10:22:16', 251, NULL),
(13, 'Skardu', '<p><span style=\"color: #374151; font-family: S&ouml;hne, ui-sans-serif, system-ui, -apple-system, \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\'; font-size: 16px; white-space-collapse: preserve; background-color: #f7f7f8;\">Skardu, nestled in the majestic Karakoram mountain range of Gilgit-Baltistan, Pakistan, is a spellbinding destination renowned for its stunning landscapes and adventurous spirit. Surrounded by towering peaks, including the world-famous K2, Skardu offers breathtaking vistas of snow-capped mountains, crystal-clear lakes, and lush green valleys. It serves as a gateway to several mountaineering expeditions and treks, attracting adventurers from around the world. Beyond its natural beauty, Skardu is steeped in rich cultural heritage, with historical sites like the 16th-century Kharpocho Fort and ancient rock carvings. With its awe-inspiring scenery, adventurous pursuits, and cultural significance, Skardu truly captivates the hearts of explorers and nature enthusiasts alike.</span></p>', 'skardu', 250, '35.3247', '75.5510', 12, 'publish', 25, 26, NULL, 1, 1, NULL, NULL, NULL, '2023-06-24 10:01:37', '2023-06-24 10:17:54', 250, NULL),
(14, 'Neelam Valley', '<p><span style=\"color: #374151; font-family: S&ouml;hne, ui-sans-serif, system-ui, -apple-system, \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\'; font-size: 16px; white-space-collapse: preserve; background-color: #f7f7f8;\">Neelam Valley, located in the Azad Kashmir region of Pakistan, is a breathtakingly beautiful destination that enchants visitors with its lush green landscapes, majestic mountains, and serene river valleys. Nestled along the Neelam River, the valley is renowned for its scenic beauty, including captivating waterfalls, vibrant meadows, and dense forests. The journey through Neelam Valley unveils picturesque villages, terraced fields, and traditional wooden houses that offer a glimpse into the local way of life. Adventure seekers can indulge in activities like hiking, trekking, and fishing, while nature lovers can immerse themselves in the tranquility of the surroundings. With its unparalleled natural beauty and a sense of serenity, Neelam Valley is a true paradise for those seeking solace in nature\'s embrace.</span></p>', 'neelam-valley', 249, '34.5985', '73.9073', 12, 'publish', 27, 28, NULL, 1, 1, NULL, NULL, NULL, '2023-06-24 10:04:36', '2023-07-15 10:40:44', 249, NULL),
(15, 'Nathiagli', '<p><span style=\"color: #374151; font-family: S&ouml;hne, ui-sans-serif, system-ui, -apple-system, \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\'; font-size: 16px; white-space-collapse: preserve; background-color: #f7f7f8;\">Nathiagali, nestled in the scenic hills of Abbottabad district in Pakistan, is a charming hill station that enchants visitors with its cool climate, lush greenery, and panoramic views. Located at an elevation of 2,500 meters, Nathiagali offers respite from the summer heat, with pleasant temperatures and refreshing mountain air. The town is adorned with beautiful forests of pine, oak, and cedar trees, providing a serene and picturesque setting. Nature lovers can explore numerous hiking trails, visit stunning viewpoints like Miranjani and Mushkpuri, and enjoy the tranquility of Ayubia National Park. With its serene atmosphere, natural beauty, and abundance of outdoor activities, Nathiagali is a perfect retreat for those seeking solace in the lap of nature.</span></p>', 'nathiagli', 252, '34.0729', '73.3812', 12, 'publish', 29, 30, NULL, 1, 1, NULL, NULL, NULL, '2023-06-24 10:24:27', '2023-06-24 10:25:35', 252, NULL),
(16, 'Chitral', '<p class=\"MsoNormal\">Chitral, located in the breathtakingly beautiful Khyber Pakhtunkhwa province of Pakistan, is a captivating destination that mesmerizes visitors with its stunning landscapes and rich cultural heritage. Nestled amidst the towering peaks of the Hindu Kush mountain range, Chitral boasts breathtaking valleys, gushing rivers, and picturesque meadows. The region is renowned for its warm hospitality and diverse cultural traditions, with the Kalash people, an indigenous community, adding a vibrant touch to the area. Visitors can explore ancient forts, such as the iconic Chitral Fort, witness traditional festivals and dances, and embark on thrilling outdoor adventures like hiking and mountaineering. With its awe-inspiring natural beauty and cultural richness, Chitral offers an unforgettable experience for those seeking an escape into the enchanting realm of the mountains.</p>', 'chitral', 255, '35.780083146168636', '71.770791313294', 12, 'publish', 31, 32, NULL, 1, 1, NULL, NULL, NULL, '2023-06-25 03:28:42', '2023-06-25 03:35:01', 255, NULL),
(17, 'Murree', '<p class=\"MsoNormal\">Murree, located in the picturesque hills of the Punjab province in Pakistan, is a popular hill station that attracts visitors with its scenic beauty, pleasant climate, and historical charm. Nestled in the foothills of the Himalayas, Murree offers a respite from the heat of the plains, with cool temperatures and refreshing mountain air. The town is known for its lush green forests, cascading waterfalls, and panoramic viewpoints that offer breathtaking vistas of the surrounding valleys. Visitors can explore the bustling Mall Road, lined with shops, restaurants, and colonial-era buildings. Murree also serves as a gateway to nearby attractions such as Ayubia National Park and Patriata, where thrilling cable car rides await. With its natural splendor, colonial heritage, and a vibrant atmosphere, Murree continues to enchant tourists as a popular destination for relaxation and rejuvenation amidst the tranquil mountains.</p>', 'murree', 256, '33.90798926729887', '73.39502462299787', 13, 'publish', 33, 34, NULL, 1, 1, NULL, NULL, NULL, '2023-06-25 03:28:58', '2023-06-25 03:40:13', 256, NULL),
(18, 'Karachi', '<p class=\"MsoNormal\">Karachi, the vibrant and cosmopolitan city of Pakistan, offers a fascinating blend of history, culture, and modernity, making it an enticing destination for tourists. Situated along the Arabian Sea, Karachi boasts stunning beaches, bustling markets, architectural landmarks, and a rich culinary scene. Visitors can explore iconic attractions like the historic Mohatta Palace, the bustling streets of Saddar and Clifton, and the vibrant neighborhoods of Old Town. The city is known for its diverse culture, with influences from various ethnicities and communities, reflected in its festivals, music, and art. Food lovers can indulge in a wide array of delicious Pakistani cuisine, from street snacks to fine dining experiences. With its warm hospitality and lively atmosphere, Karachi offers a memorable experience for tourists seeking a blend of history, culture, and contemporary charm.</p>', 'karachi', 261, '24.90309975484139', '67.00687174997181', 13, 'publish', 35, 36, NULL, 1, 1, NULL, NULL, NULL, '2023-06-26 07:35:49', '2023-06-26 07:42:44', 261, NULL),
(19, 'Lahore', '<p class=\"MsoNormal\">Lahore, often referred to as the cultural capital of Pakistan, is a city that captivates visitors with its rich history, vibrant traditions, and architectural splendors. Located in the heart of Punjab province, Lahore is a melting pot of cultures, where the old and the new seamlessly blend. The city is home to magnificent Mughal-era structures, such as the iconic Badshahi Mosque and Lahore Fort, showcasing intricate craftsmanship and architectural brilliance. The walled city of Lahore, with its narrow streets, bustling bazaars, and historic gates, offers a glimpse into the city\'s past. Lahore is renowned for its vibrant arts and cultural scene, with numerous festivals, music concerts, and theater performances throughout the year. Food lovers will be delighted by Lahore\'s culinary offerings, with mouthwatering street food, traditional delicacies, and upscale dining options. With its warm hospitality, lively atmosphere, and a deep sense of pride in its heritage, Lahore beckons travelers to explore its wonders and experience the true essence of Pakistani culture.</p>', 'lahore', 262, '31.51881634534239', '74.3576717778872', 10, 'publish', 37, 38, NULL, 1, 1, NULL, NULL, NULL, '2023-06-26 07:43:27', '2023-06-26 07:45:57', 262, NULL),
(20, 'Faislabad', '<p class=\"MsoNormal\">Faisalabad, often referred to as the \"Manchester of Pakistan,\" is a bustling industrial city known for its textile manufacturing and vibrant commercial activity. Situated in the province of Punjab, Faisalabad offers a unique blend of history, industry, and cultural heritage. The city is dotted with textile mills and factories, contributing significantly to Pakistan\'s textile industry. Faisalabad is also home to beautifully designed colonial-era buildings, reflecting its rich past as a major trading hub during British rule. The clock tower, known as Ghanta Ghar, stands tall as a symbol of the city\'s heritage. Faisalabad is a vibrant center of commerce, with bustling markets and shopping districts offering a wide range of goods and textiles. The city also boasts several educational institutions, parks, and recreational areas, providing a balance of work and leisure. Known for its warm and hospitable residents, Faisalabad welcomes visitors with open arms, offering a glimpse into the industrious spirit and cultural vibrancy of Pakistan.</p>', 'faislabad', 263, '31.461544422563456', '73.12842390877739', 10, 'publish', 39, 40, NULL, 1, 1, NULL, NULL, NULL, '2023-06-26 07:46:49', '2023-06-26 07:49:19', 263, NULL),
(21, 'Peshawar', '<p class=\"MsoNormal\">Peshawar, the capital city of Khyber Pakhtunkhwa province in Pakistan, is a city steeped in history and culture. Situated at the crossroads of ancient trade routes, Peshawar has been a center of commerce and cultural exchange for centuries. The city is known for its rich archaeological heritage, with historical sites such as the Bala Hisar Fort and the Qissa Khwani Bazaar. Peshawar\'s Old City showcases traditional architecture, narrow winding streets, and bustling markets, giving visitors a glimpse into its vibrant past. The city is also renowned for its hospitality and culinary delights, with aromatic food stalls serving flavorful street food and traditional Pashtun cuisine. Peshawar is a gateway to the scenic beauty of the Khyber Pass and the breathtaking landscapes of the surrounding mountains. With its blend of history, culture, and natural beauty, Peshawar offers a captivating experience for visitors seeking to explore the wonders of Pakistan\'s northwest region.</p>', 'peshawar', 264, '34.00033557348668', '71.53393965947774', 10, 'publish', 41, 42, NULL, 1, 1, NULL, NULL, NULL, '2023-06-26 07:50:10', '2023-06-26 07:53:42', 264, NULL),
(22, 'Multan', '<p class=\"MsoNormal\">Multan, known as the \"City of Saints\" and the \"City of Sufis,\" is a historic city nestled in the province of Punjab, Pakistan. With a rich heritage dating back thousands of years, Multan is steeped in mysticism, culture, and ancient traditions. The city is famed for its shrines and mausoleums, attracting pilgrims and devotees from all over the world. The iconic Multan Fort, a UNESCO World Heritage Site, stands as a testament to the city\'s ancient glory, showcasing intricate architectural details and commanding views of the surrounding area. Multan is also renowned for its vibrant bazaars, where artisans create and sell exquisite handicrafts, pottery, and traditional textiles. The city\'s bustling Ghanta Ghar (Clock Tower) and vibrant food streets offer a glimpse into its bustling energy and culinary delights. Multan\'s warm and welcoming residents, known for their hospitality, further enhance the city\'s charm. With its deep-rooted history, spiritual significance, and cultural treasures, Multan beckons visitors to explore its ancient wonders and experience the rich tapestry of Pakistani heritage.</p>', 'multan', 265, '30.169281189643183', '71.52545258171786', 10, 'publish', 43, 44, NULL, 1, 1, NULL, NULL, NULL, '2023-06-26 07:55:31', '2023-06-26 08:07:54', 265, NULL),
(23, 'Quetta', '<p class=\"MsoNormal\">Quetta, the capital city of Balochistan province in Pakistan, is a city of rugged beauty and historical significance. Nestled in a picturesque valley surrounded by mountains, Quetta offers stunning landscapes and a unique blend of cultures. The city serves as a gateway to the rest of Balochistan and is known for its vibrant bazaars, bustling markets, and traditional handicrafts. Quetta\'s historical sites, such as the Quaid-e-Azam Residency and the Archaeological Museum, provide a glimpse into its colonial past and ancient heritage. The city\'s pleasant climate attracts visitors seeking respite from the scorching summers in other parts of the country. Quetta is also renowned for its delicious cuisine, particularly its flavorful meat dishes and aromatic dried fruits. The local hospitality adds to the charm of the city, with friendly locals always ready to welcome visitors. Quetta\'s strategic location, natural beauty, and cultural richness make it a captivating destination for those seeking adventure, history, and exploration in the enchanting province of Balochistan.</p>', 'baluchistan', 266, '30.191445946899975', '66.97541401938584', 10, 'publish', 45, 46, NULL, 1, 1, NULL, NULL, NULL, '2023-06-26 08:08:46', '2023-06-26 08:11:13', 266, NULL),
(24, 'Kashmir', '<p class=\"MsoNormal\">Kashmir, often referred to as \"Paradise on Earth,\" is a region of breathtaking beauty nestled in the Himalayan mountain range. Divided between India, Pakistan, and China, the Indian-administered part of Kashmir is known for its stunning landscapes, lush valleys, serene lakes, and snow-capped peaks. The region captivates visitors with its picturesque beauty, making it a sought-after destination for nature lovers, adventure enthusiasts, and those seeking tranquility. Kashmir is famous for its iconic Dal Lake, where visitors can experience the charm of traditional houseboats and witness the vibrant floating markets. The Mughal Gardens in Srinagar, with their meticulously manicured lawns and cascading fountains, offer a glimpse into the region\'s architectural grandeur. The breathtaking beauty of places like Gulmarg, Pahalgam, and Sonamarg leaves a lasting impression on travelers, offering opportunities for skiing, trekking, and exploring pristine valleys. Kashmir\'s rich cultural heritage is reflected in its traditional crafts, Kashmiri cuisine, and warm hospitality. However, it is important to note that the region has been a subject of political dispute, and travelers are advised to stay informed about the current situation and adhere to travel advisories. Despite the complexities, the allure of Kashmir\'s natural beauty and cultural richness continues to beckon adventurers and seekers of serenity from around the world.</p>', 'kashmir', 267, '32.72675800056897', '74.85267110238628', 10, 'publish', 47, 48, NULL, 1, 1, NULL, NULL, NULL, '2023-06-26 08:13:34', '2023-06-26 08:15:45', 267, NULL),
(25, 'Bahawalpur', '<p class=\"MsoNormal\">Bahawalpur, located in the southern region of Punjab, Pakistan, is a city renowned for its rich history, architectural marvels, and cultural heritage. Once the princely state of Bahawalpur, the city is dotted with magnificent palaces, mosques, and forts that reflect its royal past. The grand Abbasi Mosque, with its intricate blue tile work and impressive minarets, stands as a symbol of the city\'s architectural splendor. The Noor Mahal, a beautiful palace built in Italian style, showcases a blend of eastern and western influences. Bahawalpur\'s Derawar Fort, a massive structure in the Cholistan Desert, mesmerizes visitors with its formidable walls and panoramic views. The city\'s vibrant bazaars offer a delightful shopping experience, with handicrafts, embroidered textiles, and local artwork being popular souvenirs. Bahawalpur is also known for its rich cultural traditions, including folk music, dance, and camel racing. The warm and hospitable people of Bahawalpur add to the city\'s charm, making it a welcoming destination for tourists. With its historical landmarks, cultural richness, and a glimpse into the royal heritage of the region, Bahawalpur invites visitors to explore its captivating treasures.</p>', 'bahawalpur', 268, '29.35866363489946', '71.69069434479712', 10, 'publish', 49, 50, NULL, 1, 1, NULL, NULL, NULL, '2023-06-26 08:18:48', '2023-06-26 08:19:51', 268, NULL);
