(4, 'Quetta Adventure: Exploring the Captivating Capital of Balochistan', 'quetta-adventure-exploring-the-captivating-capital-of-balochistan', '<p>Immerse yourself in the natural wonders and vibrant culture of Quetta, the captivating capital city of Balochistan. This 3-day trip offers a perfect blend of adventure, history, and scenic beauty. Discover the rugged landscapes, visit historic landmarks, and experience the warm hospitality that Quetta has to offer.</p>', 699, 699, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', NULL, 23, 'Quetta Tours', '30.191445946899975', '66.97541401938584', 12, 1, '698,697,696,695,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '850.00', '142.00', 1, 1, 11, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 5, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 11:06:32', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"698\",\"title\":\"Day 1\",\"desc\":\"Liaquat Bazaar and Suraj Gang Bazaar\",\"content\":\"Arrival in Quetta - Explore the city\'s bustling bazaars, including Liaquat Bazaar and Suraj Gang Bazaar, known for their vibrant atmosphere and local handicrafts. Visit the historic Quetta Fort and stroll through the serene Hazarganji Chiltan National Park, known for its unique flora and fauna.\"},{\"image_id\":\"696\",\"title\":\"Day 2\",\"desc\":\"Ziarat Residency\",\"content\":\"Venture to Ziarat - Take a day trip to the picturesque town of Ziarat, located in the Ziarat Valley. Visit the stunning Ziarat Residency, the historical residence of Quaid-e-Azam Muhammad Ali Jinnah. Explore the serene Juniper Forest and enjoy the peaceful ambiance of the valley.\"},{\"image_id\":\"697\",\"title\":\"Day 3\",\"desc\":\"tranquil Hanna Lake\",\"content\":\"Explore Hanna Lake and Bolan Pass - Visit the tranquil Hanna Lake, located just outside Quetta. Enjoy a picnic by the lake or take a boat ride amidst the beautiful surroundings. Later, embark on a scenic drive through the iconic Bolan Pass, marveling at the rugged landscapes and breathtaking\\u00a0views.\"}]', '4.0', NULL, NULL, NULL, NULL, NULL),
(5, 'Magical Murree: A Blissful Retreat in the Misty Hills', 'magical-murree-a-blissful-retreat-in-the-misty-hills', '<p>Experience the enchanting beauty of Murree, a popular hill station nestled in the misty hills of Pakistan. This 4-day trip will transport you to a world of serenity and natural splendor. Explore the lush green forests, enjoy panoramic views, and immerse yourself in the refreshing ambiance of Murree\'s cool mountain air.</p>\r\n<p>&nbsp;</p>', 694, 694, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 3, 17, 'Regal Tours', '33.90798926729887', '73.39502462299787', 12, NULL, '694,693,692,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '1900.00', '275.00', 1, 1, 18, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 16, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 11:00:42', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"694\",\"title\":\"Day 1\",\"desc\":\"Mall Road\",\"content\":\"Arrival in Murree - Explore the charming Mall Road, lined with shops, cafes, and colonial-era buildings. Take a leisurely stroll amidst the picturesque surroundings and enjoy local snacks like corn on the cob and roasted chestnuts. Visit Pindi Point, offering breathtaking views of the valley below.\"},{\"image_id\":\"693\",\"title\":\"Day 2\",\"desc\":\"Patriata\",\"content\":\"Explore Patriata - Venture to Patriata, located a short distance from Murree. Take a thrilling chairlift ride to New Murree, enjoying panoramic views of the surrounding hills and forests. Visit the beautiful Kashmir Point, known for its stunning vistas and tranquil ambiance.\"},{\"image_id\":\"692\",\"title\":\"Day 3\",\"desc\":\"Nathiagali\",\"content\":\"Visit Nathiagali - Journey to the scenic town of Nathiagali, known for its lush green meadows and refreshing atmosphere. Explore the charming bazaar, take a leisurely walk along the Governor\'s Road, and enjoy panoramic views from Mukshpuri Top. Indulge in local delicacies and relax amidst the natural beauty.\"},{\"image_id\":\"684\",\"title\":\"Day 4\",\"desc\":\"Murree Brewery\",\"content\":\"Enjoy Leisure Time - Spend the day at your leisure, exploring more of Murree\'s attractions or simply relaxing in the serene ambiance. Visit the Murree Brewery, take a horse ride, or immerse yourself in the local culture. Depart from Murree with cherished memories of your mountain\\u00a0retreat.\"}]', '5.0', NULL, NULL, NULL, NULL, NULL),
(6, 'Azad Kashmir Escapade: Exploring the Scenic Beauty of the Free Kashmir', 'azad-kashmir-escapade-exploring-the-scenic-beauty-of-the-free-kashmir-1', '<p>Embark on a captivating journey through the pristine landscapes and breathtaking beauty of Azad Kashmir. This 5-day trip offers an opportunity to immerse yourself in the natural wonders, tranquil lakes, verdant valleys, and charming towns of this region. Experience the untamed beauty, warm hospitality, and cultural richness that make Azad Kashmir a hidden gem to discover.</p>', 691, 691, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 3, 14, '4WD Tours', '34.5985', '73.9073', 12, 1, '690,689,691,688,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '2100.00', '231.00', 5, 1, 19, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 5, 19, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-16 10:18:09', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"690\",\"title\":\"Day 1\",\"desc\":\"Historic Red Fort\",\"content\":\"Arrival in Muzaffarabad - Explore the capital city of Azad Kashmir. Visit the historic Red Fort, enjoy panoramic views of the Neelum River from Peer Chanasi, and experience the local culture and cuisine.\"},{\"image_id\":\"689\",\"title\":\"Day 2\",\"desc\":\"Neelum Valley\",\"content\":\"Discover Neelum Valley - Venture into the enchanting Neelum Valley, known for its pristine beauty and picturesque landscapes. Visit stunning attractions such as Sharda Valley, Kel, Arang Kel, and enjoy the serene beauty of the Neelum River.\"},{\"image_id\":\"687\",\"title\":\"Day 3\",\"desc\":\"Banjosa Lake\",\"content\":\"Explore Rawalakot - Travel to Rawalakot, a charming town surrounded by lush greenery. Visit Banjosa Lake, known for its tranquil ambiance and breathtaking views. Explore the scenic Toli Peer and enjoy the peaceful surroundings.\"},{\"image_id\":\"671\",\"title\":\"Day 4\",\"desc\":\"Pir Chinasi\",\"content\":\"Journey to Sudhan Gali and Pir Chinasi - Explore the scenic beauty of Sudhan Gali, a hill station offering panoramic views of the surrounding mountains. Visit Pir Chinasi, a sacred shrine located on a hilltop, and enjoy breathtaking vistas.\"},{\"image_id\":\"653\",\"title\":\"Day 5\",\"desc\":\"Kashmiri handicrafts\",\"content\":\"Return to Muzaffarabad - Spend the day exploring Muzaffarabad\'s local markets, where you can find traditional Kashmiri handicrafts, woodwork, and local delicacies. Visit the Neelum View Point for a last glimpse of the stunning Neelum River. Depart with cherished memories of your Azad Kashmir\\u00a0adventure.\"}]', '4.8', NULL, NULL, NULL, NULL, NULL),
