(8, 'Nathiagali Serenity: A Blissful Retreat in the Green Mountains', 'nathiagali-serenity-a-blissful-retreat-in-the-green-mountains', '<p>Embark on a tranquil escape to the picturesque hill station of Nathiagali. Nestled amidst the lush green mountains of Pakistan, this 3-day trip offers a perfect blend of natural beauty, refreshing atmosphere, and serene landscapes. Immerse yourself in the tranquility of Nathiagali and rejuvenate your senses in this idyllic mountain getaway.</p>', 685, 685, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 3, 15, 'Nothern Tours', '34.0729', '73.3812', 12, NULL, '686,685,684,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '2100.00', '685.00', 1, 1, 16, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 5, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 10:38:00', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"684\",\"title\":\"Day 1\",\"desc\":\"Hill Station\",\"content\":\"Arrival in Nathiagali - Explore the charming hill station, take leisurely walks through the enchanting pine forests, and enjoy breathtaking views of the surrounding valleys. Visit Donga Gali, a nearby forested area known for its scenic hiking trails.\"},{\"image_id\":\"685\",\"title\":\"Day 2\",\"desc\":\"Ayubia National Park\",\"content\":\"Excursion to Ayubia National Park - Venture to Ayubia National Park, just a short distance from Nathiagali. Indulge in nature walks amidst the picturesque landscapes, spot wildlife, and visit the viewpoints offering panoramic vistas. Enjoy a picnic lunch amidst the serene surroundings.\"},{\"image_id\":\"686\",\"title\":\"Day 3\",\"desc\":\"Governor\'s House,\",\"content\":\"Explore Nathiagali\'s Local Attractions - Visit the famous Governor\'s House, a historic building surrounded by beautiful gardens. Take a scenic drive to Mukshpuri Top, a stunning viewpoint offering sweeping views of the Himalayan peaks. Conclude the trip with a memorable sunset view from Nathiagali\'s famous\\u00a0viewpoint.\"}]', '4.7', NULL, NULL, NULL, NULL, NULL),
(9, 'Peshawar Delights: Exploring the Cultural Hub of Khyber Pakhtunkhwa', 'peshawar-delights-exploring-the-cultural-hub-of-khyber-pakhtunkhwa', '<p>Immerse yourself in the vibrant city of Peshawar, a cultural gem of Khyber Pakhtunkhwa. Discover its rich history, captivating bazaars, mouthwatering cuisine, and warm hospitality. This 4-day trip will take you on a journey through the bustling streets, ancient landmarks, and hidden gems of Peshawar, offering a truly authentic experience.</p>\r\n<p>&nbsp;</p>', 682, 682, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 2, 21, '4WD Tours', '34.00033557348668', '71.53393965947774', 12, NULL, '683,682,681,680,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '2100.00', '924.00', 5, 1, 20, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 5, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 09:47:50', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"681\",\"title\":\"Day 1\",\"desc\":\"Peshawar Museum\",\"content\":\"Visit the historic Peshawar Museum, explore the Qissa Khwani Bazaar known for its bustling market and fascinating stories, and indulge in authentic Pashtun cuisine.\"},{\"image_id\":\"682\",\"title\":\"Day 2\",\"desc\":\"Mahabat Khan Mosque\",\"content\":\"Discover the Cultural Heritage - Explore the iconic Mahabat Khan Mosque, stroll through the old city streets, visit the historic Bala Hisar Fort, and experience the vibrant atmosphere of Namak Mandi, famous for its delectable street food.\"},{\"image_id\":\"680\",\"title\":\"Day 3\",\"desc\":\"Buddhist site of Takht-i-Bahi\",\"content\":\"Excursion to Historic Landmarks - Journey to the nearby ancient Buddhist site of Takht-i-Bahi, a UNESCO World Heritage Site, and explore the impressive ruins. Visit the nearby Shahbaz Garhi Rock Edicts, showcasing ancient inscriptions.\"},{\"image_id\":\"683\",\"title\":\"Day 4\",\"desc\":\"Museum of Arts and Crafts\",\"content\":\"Explore Local Art and Crafts - Visit the Peshawar Museum of Arts and Crafts to witness the intricate craftsmanship of local artisans. Spend the afternoon browsing traditional craft markets, such as Qissa Khwani Crafts Market, and purchase unique\\u00a0souvenirs.\"}]', '4.5', NULL, NULL, NULL, NULL, NULL),
(10, 'Thallay Valley', 'thallay-valley', '<p>From tiny seasonal settlements of the upper valleys displaying the fascinating Balti culture to the crossing of the snow-capped Thallay La. This easy &amp; adventurous trek connects the two Kingdoms on the world\'s roof, i.e. Khaplu with Shigar. The trip is remarkably varied in terms of the natural landscape, ranging from the sands of the Indus valley, by way of the \"Alpine \" lower valley, to the high snows of the spectacular peaks surrounding the Thallay La.</p>', 678, 678, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 3, 16, 'Chitral Tours', '35.780083146168636', '71.770791313294', 12, NULL, '679,678,677,676,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '2100.00', '1162.00', 9, 1, 17, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 5, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 09:36:00', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"679\",\"title\":\"Day 1\",\"desc\":\"Thalley Valley\",\"content\":\"Depart from Skardu and head towards Thalley Valley. Begin the trek by immersing yourself in the fascinating Balti culture as you pass through tiny seasonal settlements of the upper valleys. Experience the charm and hospitality of the locals while enjoying the picturesque landscapes of the lower valley.\"},{\"image_id\":\"676\",\"title\":\"Day 2\",\"desc\":\"Kingdoms of Khaplu and Shigar\",\"content\":\"Embark on an easy yet adventurous trek towards Thallay La, the snow-capped pass connecting the two Kingdoms of Khaplu and Shigar. Witness the remarkable transition in the natural landscape, from the sands of the Indus valley to the alpine lower valley, and finally to the majestic snow-covered peaks surrounding Thallay La. Enjoy the breathtaking views from the pass before concluding\\u00a0the\\u00a0trip.\"},{\"image_id\":\"678\",\"title\":\"Day 3\",\"desc\":\"Gasherbrum\",\"content\":\"Continue the trek towards Gasherbrum Base Camp, where you\'ll witness the towering Gasherbrum peaks, including Gasherbrum I (Hidden Peak) and Gasherbrum II. Marvel at the breathtaking views and immerse yourself in the rugged wilderness.\"}]', '5.0', NULL, NULL, NULL, NULL, NULL),
(11, '3 Days Tour to Skardu, Deosai Pakistan', '3-days-tour-to-skardu-deosai-pakistan', '<p>Learn and explore all about Skardu, Shangrila, and Deosai on this private three day tour of Pakistan. Starting and ending in Islamabad, you&rsquo;ll visit lakes, go over passes, ride in 4x4s, explore cities and do some shopping, and get into the mountains too. Many meals are included, along with your guide and private transfer the entire way.</p>', 672, 672, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 3, 16, 'New Chitral Travellers', '35.780083146168636', '71.770791313294', 12, NULL, '675,674,673,672,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '2100.00', '1772.00', 9, 1, 15, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 4, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 09:30:16', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"674\",\"title\":\"Day 1\",\"desc\":\"Skardu Fort\",\"content\":\"Depart from Islamabad and head towards Skardu. Explore the vibrant city, visit the historic Skardu Fort, and immerse yourself in the local culture. Enjoy a scenic drive to Shangrila Resort, known for its breathtaking views and serene surroundings. Spend the evening relaxing by the Upper Kachura Lake.\"},{\"image_id\":\"673\",\"title\":\"Day 2\",\"desc\":\"Deosai National Park\",\"content\":\"Embark on a full-day excursion to Deosai National Park, one of the highest plateaus in the world. Marvel at the vastness of the Deosai Plains, home to diverse flora and fauna. Enjoy a picnic lunch amidst the picturesque landscapes and have the opportunity to spot Himalayan brown bears and other wildlife.\"},{\"image_id\":\"675\",\"title\":\"Day 3\",\"desc\":\"local bazaars for shopping\",\"content\":\"Return to Skardu and explore the local bazaars for shopping and experiencing the local cuisine. Visit the beautiful Satpara Lake and enjoy a boat ride. In the evening, depart for Islamabad, concluding the tour with unforgettable\\u00a0memories.\"}]', '4.7', NULL, NULL, NULL, NULL, NULL);
