(12, 'Northern Pakistan Tour', 'northern-pakistan-tour', '<p>This is a specially designed guided tour in which you explore the all the major landmarks of northern side and Islamabad. During this journey you will explore the most beautiful destinations. The duration of the tour has been stretched to 4 days so that you could enjoy the tour.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Some of the Major Highlights of the Tour&nbsp;</p>\r\n<p>- Visit and immerse in the beautiful valleys in the mountain ranges of Karakoram, Hindu Kush, and the Himalayas.&nbsp;</p>\r\n<p>- Road adventure through the beautiful Karakoram Highway and witness the surreal natural beauty during the journey.&nbsp;</p>\r\n<p>- Meet and greet with some of the friendliest people in the mountain communities.&nbsp;</p>\r\n<p>- First-hand experience of the immense natural beauty in the mountain ranges in Northern Pakistan.&nbsp;</p>\r\n<p>- Visit some of the largest glaciers, mountain ranges, lakes, waterfalls, and meadows..</p>', 668, 668, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 3, 13, '4WD Tours', '35.3247', '75.5510', 12, 1, '670,669,667,668,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '2100.00', '123.00', 4, 1, 18, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 15, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 09:21:23', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"670\",\"title\":\"Day 1\",\"desc\":\"Altit and Baltit Forts\",\"content\":\"Begin the tour by visiting the stunning Hunza Valley. Explore the enchanting Karimabad town, visit Altit and Baltit Forts, and enjoy panoramic views of the Karakoram Range.\"},{\"image_id\":\"669\",\"title\":\"Day 2\",\"desc\":\"Shigar Valley\",\"content\":\"Journey towards the majestic Skardu, known as the gateway to the world\'s largest glaciers. Explore the mesmerizing Shigar Valley, visit the 700-year-old Shigar Fort, and marvel at the beauty of the Upper Kachura Lake.\"},{\"image_id\":\"668\",\"title\":\"Day 3\",\"desc\":\"Khunjerab Pass\",\"content\":\"Discover the wonders of Gilgit-Baltistan region by visiting the captivating Khunjerab Pass, the highest border crossing in the world. Experience the breathtaking landscapes of the Karakoram Highway and witness the convergence of three great mountain ranges.\"},{\"image_id\":\"667\",\"title\":\"Day 4\",\"desc\":\"Naltar Valley\",\"content\":\"Conclude the tour by exploring the beautiful Naltar Valley, known for its colorful meadows, crystal-clear lakes, and pristine waterfalls. Immerse yourself in the natural beauty of this hidden gem before\\u00a0departing.\"}]', '4.0', NULL, NULL, NULL, NULL, NULL),
(13, 'Karakorum and Himalayan Giants Base camp Trek', 'karakorum-and-himalayan-giants-base-camp-trek', '<p>Join this 5 day adventure in Pakistan that gets you into the Himalayas and the base camps of the mountains there. Your guide and crew will safely get you to K2 Base Camp, Gasherbrum Base Camp, Fairy Meadow, Nange Perbat Base Camp, and back to Islamabad where you started. Most meals are included while on trek, and either hotels or camping are provided for accommodation.</p>', 663, 663, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 3, 13, 'Pak Trip Advisor', '35.3247', '75.5510', 12, NULL, '664,663,662,661,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '2100.00', '1090.00', 9, 1, 11, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 1, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 09:08:51', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"664\",\"title\":\"Day 1\",\"desc\":\"K2 Base Camp\",\"content\":\"Begin the trek from Askole and trek towards the iconic K2 Base Camp, surrounded by the majestic Karakoram range. Experience the awe-inspiring beauty of the Baltoro Glacier along the way.\"},{\"image_id\":\"663\",\"title\":\"Day 2\",\"desc\":\"Gasherbrum Base Camp\",\"content\":\"Continue the trek towards Gasherbrum Base Camp, where you\'ll witness the towering Gasherbrum peaks, including Gasherbrum I (Hidden Peak) and Gasherbrum II. Marvel at the breathtaking views and immerse yourself in the rugged wilderness.\"},{\"image_id\":\"662\",\"title\":\"Day 3\",\"desc\":\"Fairy Meadow\",\"content\":\"Trek back towards Askole and then proceed towards Fairy Meadow, a picturesque alpine meadow offering mesmerizing views of Nanga Parbat, the \\\"Killer Mountain.\\\" Relax and soak in the natural beauty of the surroundings.\"},{\"image_id\":\"661\",\"title\":\"Day 4\",\"desc\":\"Nanga Parbat\",\"content\":\"Embark on a thrilling journey towards Nanga Parbat Base Camp, surrounded by the dramatic peaks of the Himalayan giants. Experience the grandeur of Nanga Parbat and take in the pristine mountain landscapes.\"},{\"image_id\":\"660\",\"title\":\"Day 5\",\"desc\":\"Himalayan\\u00a0Giants.\",\"content\":\"Return from Nanga Parbat Base Camp to Fairy Meadow, enjoying the enchanting views one last time. Depart from Fairy Meadow, taking with you memories of the incredible Karakoram and Himalayan\\u00a0Giants.\"}]', '4.5', NULL, NULL, NULL, NULL, NULL),
(14, 'Private Islamabad City Tour', 'private-islamabad-city-tour', '<p>Enjoy an in-depth guided tour of Pakistan&rsquo;s greenest city on this stunning day trip out in the capital. Cover more sights in less time, traveling between locations in a privately chauffeured vehicle. Highlights include a trip to the preserved village of Saidpur, the cutting-edge architecture of Faisal Mosque, and Lake View Park, an aviary packed with exotic bird species.</p>', 659, 659, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 1, 10, 'Islamabad Tourism Planner', '33.7294', '73.0395', 12, NULL, '658,657,656,659,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '2100.00', '424.00', 6, 1, 12, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 7, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 09:01:43', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"659\",\"title\":\"Day 1\",\"desc\":\"Saidpur Village\",\"content\":\"Explore Saidpur Village, a charming and historic neighborhood in Islamabad. Immerse yourself in its cultural heritage, visit the local market, and indulge in traditional cuisine.\"},{\"image_id\":\"658\",\"title\":\"Day 2\",\"desc\":\"Faisal Mosque\",\"content\":\"Discover the architectural marvel of Faisal Mosque, a symbol of modern Islamic architecture. Admire its grandeur and explore the serene surroundings.\"},{\"image_id\":\"657\",\"title\":\"Day 3\",\"desc\":\"Lake View Park\",\"content\":\"Visit Lake View Park, a scenic recreational spot in Islamabad. Explore the beautiful gardens, enjoy a boat ride on the lake, and visit the aviary to witness a variety of exotic bird species.\"},{\"image_id\":\"656\",\"title\":\"Day 4\",\"desc\":\"Pakistan Monument\",\"content\":\"Take a leisurely day to revisit any favorite spots, explore the local markets for souvenirs, or relax and enjoy the serene ambiance of Islamabad before\\u00a0departing.\"}]', '4.5', NULL, NULL, NULL, NULL, NULL),
(15, '9 Days Tour to Hunza, Phandar and Shandur from April to October', 'cannes-and-antibes-night-tour', '<p>We are one of the leading tourism company of Pakistan, operational since 2011. We are offering both</p>\r\n<p>customized and standard packages, The current package is as per the standard services. But you</p>\r\n<p>can reach us and ask for more tailor made tours.</p>', 653, 653, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 3, 11, 'Hunza Pakistan', '36.323104934271306', '74.66986781932093', 12, 1, '654,653,652,650,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '2100.00', '986.00', 4, 1, 13, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 4, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 11:07:44', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"653\",\"title\":\"Day 1\",\"desc\":\"Arrive in Hunza - Explore Karimabad, visit Altit Fort and Baltit Fort.\",\"content\":\"There are no activities planned until an evening welcome meeting. Additional Notes: We highly recommend booking pre-tour accommodation to fully experience this crazy city.\"},{\"image_id\":\"652\",\"title\":\"Day 2\",\"desc\":\"Journey to Attabad Lake and enjoy a boat ride. Continue to Passu Glacier and Passu Cones for breathtaking views.\",\"content\":\"Pack up the van in the morning and check out the stars on the most famous sidewalk in Hollywood on an orientation tour\"},{\"image_id\":\"650\",\"title\":\"Day 3\",\"desc\":\"Explore Khunjerab Pass, the highest paved international border crossing in the world. Witness stunning landscapes and wildlife.\",\"content\":\"Travel to one of the country\'s most rugged landscapes \\u2014 the legendary Death Valley, California. Soak in the dramatic landscape. In the afternoon, continue on to Bakersfield for the night.\"},{\"image_id\":\"654\",\"title\":\"Day 4\",\"desc\":\"Travel to Phandar Valley, a hidden gem known for its pristine lakes and lush green meadows. Enjoy a leisurely day amidst nature.\",\"content\":\"We highly recommend booking post-accommodation to fully experience this famous city.\"},{\"image_id\":\"648\",\"title\":\"Day 5\",\"desc\":\"Visit the Shandur Pass, renowned for its annual polo festival. Experience the thrill of watching a traditional polo match.\",\"content\":\"Travel to one of the country\'s most rugged landscapes \\u2014 the legendary Death Valley, California. Soak in the dramatic landscape. In the afternoon, continue on to Bakersfield for the night.\"},{\"image_id\":\"645\",\"title\":\"Day 6\",\"desc\":\"Explore Gilgit city and visit the historic Gilgit Fort and Kargah Buddha. Enjoy the local cuisine and cultural experiences.\",\"content\":\"There are no activities planned until an evening welcome meeting. Additional Notes: We highly recommend booking pre-tour accommodation to fully experience this crazy city.\"},{\"image_id\":\"642\",\"title\":\"Day 7\",\"desc\":\"Journey back to Hunza and visit the iconic Rakaposhi viewpoint for panoramic views of the majestic peak.\",\"content\":\"Travel to one of the country\'s most rugged landscapes \\u2014 the legendary Death Valley, California. Soak in the dramatic landscape. In the afternoon, continue on to Bakersfield for the night.\"},{\"image_id\":\"646\",\"title\":\"Day 8\",\"desc\":\"Visit the ancient Ganish Village and discover its unique cultural heritage. Explore the ancient rock carvings.\",\"content\":\"There are no activities planned until an evening welcome meeting. Additional Notes: We highly recommend booking pre-tour accommodation to fully experience this crazy city.\"},{\"image_id\":\"649\",\"title\":\"Day 9\",\"desc\":\"Depart from Hunza, bidding farewell to the captivating beauty\\u00a0of\\u00a0the\\u00a0region.\",\"content\":\"Travel to one of the country\'s most rugged landscapes \\u2014 the legendary Death Valley, California. Soak in the dramatic landscape. In the afternoon, continue on to Bakersfield for the night.\"}]', '4.7', NULL, NULL, NULL, NULL, NULL),
(16, 'Hunza Valley Tour Pakistan', 'hunza-valley-tour-pakistan', '<p>See The Altit and Unesco Listed Baltit Forts of the Hunza valley Pakistan</p>\r\n<p>See Medieval Forts Hidden Among Pakistan&rsquo;s Towering Mountains.</p>\r\n<p>Trek on the Black Glacier beneath the beautiful Karakoram Peaks</p>\r\n<p>Camping at Fairy Meadow, Right under Nanga Parbat.</p>\r\n<p>See The Altit and Baltit Forts of the Hunza valley Pakistan</p>\r\n<p>Sneaky view of Nanga Parbat (8126m) and Rakaposhi (7788m) from KKH.</p>', 648, 648, 'From the iconic to the unexpected, the city of San Francisco never ceases to surprise. Kick-start your effortlessly delivered Northern California holiday in the cosmopolitan hills of \'The City\'. Join your Travel Director and fellow travellers for a Welcome Reception at your hotel.Welcome Reception', 3, 11, 'Hunza, Pakistan', '36.323104934271306', '74.66986781932093', 12, NULL, '650,649,648,647,646,651,', 'https://www.youtube.com/watch?v=UfEiKK-iX70', '2100.00', '166.00', 7, 1, 12, '[{\"title\":\"When and where does the tour end?\",\"content\":\"Your tour will conclude in San Francisco on Day 8 of the trip. There are no activities planned for this day so you\'re free to depart at any time. We highly recommend booking post-accommodation to give yourself time to fully experience the wonders of this iconic city!\"},{\"title\":\"When and where does the tour start?\",\"content\":\"Day 1 of this tour is an arrivals day, which gives you a chance to settle into your hotel and explore Los Angeles. The only planned activity for this day is an evening welcome meeting at 7pm, where you can get to know your guides and fellow travellers. Please be aware that the meeting point is subject to change until your final documents are released.\"},{\"title\":\"Do you arrange airport transfers?\",\"content\":\"Airport transfers are not included in the price of this tour, however you can book for an arrival transfer in advance. In this case a tour operator representative will be at the airport to greet you. To arrange this please contact our customer service team once you have a confirmed booking.\"},{\"title\":\"What is the age range\",\"content\":\"This tour has an age range of 12-70 years old, this means children under the age of 12 will not be eligible to participate in this tour. However, if you are over 70 years please contact us as you may be eligible to join the tour if you fill out G Adventures self-assessment form.\"}]', 'publish', NULL, 1, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 08:38:13', 1, '[{\"title\":\"Specialized bilingual guide\"},{\"title\":\"Private Transport\"},{\"title\":\"Entrance fees (Cable and car and Moon Valley)\"},{\"title\":\"Box lunch water, banana apple and chocolate\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', '[{\"image_id\":\"650\",\"title\":\"Day 1\",\"desc\":\"Altit and Baltit Forts\",\"content\":\"There are no activities planned until an evening welcome meeting. Additional Notes: We highly recommend booking pre-tour accommodation to fully experience this crazy city.\"},{\"image_id\":\"649\",\"title\":\"Day 2\",\"desc\":\"Serene Attabad Lake\",\"content\":\"Pack up the van in the morning and check out the stars on the most famous sidewalk in Hollywood on an orientation tour\"},{\"image_id\":\"648\",\"title\":\"Day 3\",\"desc\":\"Gojal Valley\",\"content\":\"Travel to one of the country\'s most rugged landscapes \\u2014 the legendary Death Valley, California. Soak in the dramatic landscape. In the afternoon, continue on to Bakersfield for the night.\"},{\"image_id\":\"646\",\"title\":\"Day 4\",\"desc\":\"Raka-Poshi View Point\",\"content\":\"We highly recommend booking post-accommodation to fully experience this famous city.\"}]', '4.4', NULL, NULL, NULL, NULL, NULL);
