INSERT INTO `core_news` (`id`, `title`, `content`, `slug`, `status`, `cat_id`, `image_id`, `create_user`, `update_user`, `deleted_at`, `origin_id`, `lang`, `created_at`, `updated_at`) VALUES
(1, 'Pakistan travel guide: Visas for Pakistan', '<p>Almost everyone needs a visa for Pakistan. It used to be a real pain in the butt to get a visa for Pakistan, but the recent e-visa introduction made things much easier. The e-visa form is still way too long and full of irrelevant questions, but at least it&rsquo;s a start in the right direction.</p>\r\n<p>To find out if you&rsquo;re eligible for a Pakistani e-visa, go to the e-visa portal of Pakistan. It also mentions a visa on arrival scheme, but many have reported problems with it. It&rsquo;s better to apply for an e-visa.</p>\r\n<p>How to apply for a Pakistan e-visa</p>\r\n<p>Ensure you have JPEG files of:</p>\r\n<p>&nbsp;</p>\r\n<p>Passport information page</p>\r\n<p>Passport photo with a white background</p>\r\n<p>Letter of invitation by a tour company or hotel booking confirmation</p>\r\n<p>Step 1</p>\r\n<p>Go to the Pakistan e-visa portal and register yourself. To do this, click the &ldquo;Tourist Visa&rdquo; button under &ldquo;Visa Categories&rdquo;. It will lead you to the info page about tourist visas. If you click &ldquo;Apply now&rdquo;, you&rsquo;ll be prompted to create a new account or log in to an existing account.</p>\r\n<p>Step 2</p>\r\n<p>Once registered you can start your application. Allow you have plenty of time, as it can easily take an hour or more to fill out all the questions. Many of them seem unnecessary (and probably are) but alas, you have to fill in the entire form.</p>\r\n<p>Step 3</p>\r\n<p>&nbsp;</p>\r\n<p>Once you&rsquo;ve finished your application, it&rsquo;s time to pay. The visa costs US$35 for most nationalities. You can pay with Visa or MasterCard. I&rsquo;ve heard reports of the payment not working all the time, so check you actually paid.</p>\r\n<p>Step 4</p>\r\n<p>After you&rsquo;ve paid, click &ldquo;Submit your Application&rdquo;. If you don&rsquo;t do this, the application will remain pending.</p>\r\n<p>The e-visa portal states it takes 5-7 working days for a visa to be approved, but turnaround can be much faster. If you haven&rsquo;t heard anything after 7 working days, contact them directly via the e-visa portal. It&rsquo;s possible they need additional documentation from you.</p>', 'visas-for-pakistan', 'publish', 1, 114, 1, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 13:14:22'),
(2, 'Pure Luxe in Punta Mita', '<p>Pakistan is a relatively cheap country to travel, although it can be tricky to find budget accommodation outside of the popular tourist destinations or in high season (June &ndash; August). Below is a breakdown of the average cost of traveling in Pakistan on a backpacker budget.</p>\r\n<p>At the time of writing, US$1 = 155 Rs.</p>\r\n<p>Food &amp; drinks</p>\r\n<p>Water or soda: 30 &ndash; 100 Rs</p>\r\n<p>Tea: 10 &ndash; 50 Rs</p>\r\n<p>Breakfast and lunch: 50 &ndash; 100 Rs each</p>\r\n<p>Dinner: 50 &ndash; 250 Rs (street food ahoy!)</p>\r\n<p>Accommodation</p>\r\n<p>Budget hotels: 800 &ndash; 1,500 Rs</p>\r\n<p>Mid-range: 1,500&nbsp; &ndash; 4,000 Rs</p>\r\n<p>Cultural outings</p>\r\n<p>Museums: 200 &ndash; 500 Rs</p>\r\n<p>Historical sights: 500 &ndash; 1,000Rs</p>\r\n<p>National Parks: 800 Rs</p>\r\n<p>Mosques: Free</p>\r\n<p>If you do travel to Pakistan during high season, try to book accommodation ahead of time. Popular places along the Karakoram Highway, such as Hunza, are really popular with Pakistani tourists, and places can be full. Pakistan Traveller is a fantastic Pakistan travel guide that has a multitude of hotel recommendations for everywhere and anywhere you might want to travel in Pakistan.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/images1.jpeg\" alt=\"\" width=\"183\" height=\"276\" /></p>\r\n<p>Famous sights like Baltit Fort in Hunza will cost around 1,000 Rs for a foreigner ticket</p>', 'pure-luxe-in-punta-mita', 'publish', 1, 115, 1, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 13:13:37'),
(3, 'Food and Culinary Delights: Exploring the Flavors of Pakistan', '<p>Introduction:</p>\r\n<p>Pakistan\'s culinary scene is as diverse and vibrant as its cultural heritage. From aromatic spices to mouthwatering street food, this blog invites you on a gastronomic journey to discover the rich flavors and culinary traditions that make Pakistan a paradise for food enthusiasts.</p>\r\n<p>Paragraph 1:</p>\r\n<p>Pakistani cuisine is a fusion of flavors influenced by various regions and neighboring countries. Indulge in the fragrant and robust flavors of biryani, a rice dish infused with aromatic spices, or savor the succulent kebabs, grilled to perfection and bursting with smoky goodness. Don\'t forget to sample the delectable karahi, a savory meat or vegetable dish cooked in a thick, spicy tomato-based gravy.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/32.jpg\" alt=\"\" width=\"375\" height=\"280\" /></p>\r\n<p>Paragraph 2:</p>\r\n<p>Street food is an integral part of Pakistani culinary culture, offering a delightful array of flavors and textures. Take a stroll through the bustling streets and savor the iconic samosas, crispy and savory pastries filled with spiced potatoes or meat. Treat your taste buds to gol gappay, small crispy shells filled with tangy tamarind water and spicy chickpeas, or indulge in the sweet delight of jalebi, a deep-fried pretzel-shaped dessert soaked in sugar syrup.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/11.jpg\" alt=\"\" width=\"612\" height=\"407\" /></p>\r\n<p>Paragraph 3:</p>\r\n<p>Each region in Pakistan has its own unique specialties. In Lahore, feast on the traditional Lahori breakfast of halwa puri, a combination of sweet semolina pudding and flaky deep-fried bread. Explore the coastal city of Karachi and indulge in its famous seafood delights, from succulent fish tikka to spicy prawn biryani. In the mountainous regions of Gilgit-Baltistan, sample the nourishing apricot oil and delectable walnut cakes.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/22.jpg\" alt=\"\" width=\"1280\" height=\"720\" /></p>\r\n<p>Paragraph 4:</p>\r\n<p>Food in Pakistan is not just about taste; it is a celebration of togetherness and hospitality. Embrace the culture of \"dawat,\" where families and friends gather to share a meal and create cherished memories. Experience the warm hospitality of Pakistani households as they open their doors and invite you to enjoy traditional dishes prepared with love and care.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/42.jpg\" alt=\"\" width=\"1600\" height=\"768\" /></p>', 'food-and-culinary-delights-exploring-the-flavors-of-pakistan', 'publish', 5, 744, 1, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 13:07:10'),
(4, 'Pakistan Travel Guide: Immerse Yourself in the Vibrant Culture', '<p>Introduction:</p>\r\n<p>Pakistan is a land of rich cultural heritage, where diverse traditions, languages, and customs intertwine to create a tapestry of vibrant experiences. In this travel guide, we invite you to delve into the captivating culture of Pakistan, from its colorful festivals to its warm hospitality and artistic expressions.</p>\r\n<p>Paragraph 1:</p>\r\n<p>The Pakistani people are known for their warm and welcoming nature, making hospitality an integral part of the culture. Prepare to be greeted with open arms as you embark on your journey across this enchanting land. Engage with the locals, savor traditional cuisine, and embrace the warmth of Pakistani hospitality.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/52.jpg\" alt=\"\" width=\"1280\" height=\"720\" /></p>\r\n<p>Paragraph 2:</p>\r\n<p>The cultural diversity of Pakistan is truly remarkable. From the bustling bazaars of Lahore to the ancient archaeological sites of Mohenjo-Daro, every region showcases its unique cultural heritage. Explore the architectural wonders of Mughal and Islamic influence, such as the grand Badshahi Mosque and the historic Lahore Fort.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/31.jpg\" alt=\"\" width=\"640\" height=\"359\" /></p>\r\n<p>Paragraph 3:</p>\r\n<p>Music and dance are integral to Pakistani culture. Attend a qawwali performance in Lahore, where the soulful melodies of Sufi music will transport you to another realm. Experience the energetic and vibrant folk dances, such as the lively Bhangra and graceful Kathak, which showcase the rhythm and joy of Pakistani traditions.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/51a75e88-dreamstimem1803504821.jpeg\" alt=\"\" width=\"1080\" height=\"720\" /></p>\r\n<p>Paragraph 4:</p>\r\n<p>Pakistani festivals are a celebration of culture, faith, and unity. Witness the colorful extravaganza of Basant, the spring festival of kite flying, in Lahore. Immerse yourself in the spiritual fervor of Eid-ul-Fitr or witness the exuberance of the traditional horse and cattle show during Sibi Mela. Each festival offers a glimpse into the rich tapestry of Pakistani culture.</p>', 'pakistan-travel-guide-immerse-yourself-in-the-vibrant-culture', 'publish', 1, 738, 1, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 12:55:37'),
(5, 'Family Travel and Tips: Embark on Memorable Adventures Across Pakistan', '<p>Introduction:</p>\r\n<p>Embarking on a family adventure is an incredible way to create lasting memories and strengthen bonds. Pakistan, with its diverse landscapes and rich cultural heritage, offers a myriad of opportunities for family travel. In this blog, we\'ll explore some valuable tips to ensure a smooth and enjoyable journey as you explore the wonders of Pakistan with your loved ones.</p>\r\n<p>Paragraph 1:</p>\r\n<p>Planning is key when it comes to family travel in Pakistan. Start by researching the destinations that suit your family\'s interests and preferences. Whether you\'re seeking breathtaking mountain vistas, historical landmarks, or vibrant city experiences, Pakistan has it all. Consider the age and interests of your children and choose activities and attractions that cater to their needs.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/238397.jpg\" alt=\"\" width=\"1600\" height=\"1065\" /></p>\r\n<p>Paragraph 2:</p>\r\n<p>Safety should be a top priority during your family adventures. Before traveling, familiarize yourself with local customs, traditions, and safety guidelines. Keep emergency contact numbers handy and ensure your accommodations provide a secure environment for your family. It\'s also wise to pack a first-aid kit with essential supplies for any unforeseen situations.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/51a75e88-dreamstimem180350482.jpeg\" alt=\"\" width=\"1080\" height=\"720\" /></p>\r\n<p>Paragraph 3:</p>\r\n<p>Engage your children in the planning process to foster excitement and anticipation. Involve them in selecting attractions or activities that capture their imagination. Encourage their curiosity by exploring interactive museums, local markets, and engaging in cultural experiences. This will create cherished memories and help them appreciate the beauty and diversity of Pakistan.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/istockphoto-917583884-612x612.jpg\" alt=\"\" width=\"612\" height=\"472\" /></p>\r\n<p>Paragraph 4:</p>\r\n<p>Flexibility is crucial when traveling with a family. Be prepared for unexpected changes in your itinerary and allow for downtime to rest and recharge. Keep in mind that children may tire easily, so plan for shorter, more manageable activities. Pack snacks, water, and entertainment options such as books, games, or tablets to keep children occupied during long journeys.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/family-tour-pacakge-from-pakistan0.jpg\" alt=\"\" width=\"1519\" height=\"350\" /></p>\r\n<p>Conclusion:</p>\r\n<p>Family travel across Pakistan offers a world of exploration and adventure. By planning ahead, prioritizing safety, involving children in the decision-making process, and maintaining flexibility, you can ensure a memorable and enriching experience for the entire family. Whether you\'re hiking in the scenic mountains, exploring ancient ruins, or immersing yourselves in the vibrant culture of Pakistan, these family travel tips will help you make the most of your journey, creating lifelong memories along the way.</p>', 'family-travel-and-tips-embark-on-memorable-adventures-across-pakistan', 'publish', 1, 734, 1, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 12:49:09'),
(6, 'How to spend 2 days in Karachi?', '<p>Full of life and bustle, Karachi is the hub of all of the country&rsquo;s commercial activities, with colonial history and a large ethnic population that has also taken part in shaping its current setting and vibe. While the city may be large, it is possible to draw a fair picture of what it feels like to live in Karachi, even in 48 hours. Follow our guide to find out exactly how.</p>\r\n<p>Day 1</p>\r\n<p>Morning</p>\r\n<p>Take an early morning stroll at Clifton Beach, also called sea view, to start your day rejuvenated with a fresh breeze. The Arabian Sea is the heart of life and leisure in Karachi with scores of people visiting it daily for relaxation. If you walk over towards the Village Restaurant, which is a little ahead of Clifton Beach, you&rsquo;ll come near a mostly empty patch of beach where you could take a quick dip if you&rsquo;re staying nearby, as there are no showers or bathrooms on these shores.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/1.jpg\" alt=\"\" width=\"1024\" height=\"683\" /></p>\r\n<p>Next, it&rsquo;s time to catch some breakfast so head to Xander&rsquo;s Cafe, the Clifton branch, which serves scrumptious continental food and particularly good breakfast. Their outdoor seating area is perfect if you are looking forward to catching some sun and prefer sitting near trees and flowers.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/2.jpg\" alt=\"\" width=\"1024\" height=\"770\" /></p>\r\n<p>&nbsp;</p>\r\n<p>Once satiated, enjoy art in some of the city&rsquo;s best art galleries, only a short distance away, namely Canvas and Gandhara. Using Google Maps, you can quickly walk towards Canvas first, which one of the oldest and most renowned galleries for holding some of the best pioneering artists and exhibitions. Next, you can walk to the nearby Gandhara Art to witness some exemplary works of modern Pakistani art, as well as young budding talents.</p>\r\n<p>&nbsp;</p>\r\n<p>Afternoon</p>\r\n<p>In the afternoon, grab brunch and drinks at Caf&eacute; Flo, which serves exceptional French fine dining cuisine in a lovely and quaint setting. You may be asking yourself when you will get to try Pakistani food, so let me tell you that your day two itinerary is all about local cuisine &ndash; we&rsquo;re just warming your stomach up!</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/3.jpg\" alt=\"\" width=\"820\" height=\"1024\" /></p>\r\n<p>After brunch &ndash; or lunch &ndash; book an Uber to head over to the Tooba Masjid, a pretty low domed structure that is a product of intricate Islamic architecture and contemporary aesthetics with its light blue walls and large white marble dome. The serenity and peace found here will wash over you in the silent afternoon hours and the green lawns that surround it are perfect to de-stress for a while.</p>\r\n<p>From the Tooba Masjid, head over to the National Museum of Pakistan on Burns Road. This museum contains an extensive record of the cultural history of Pakistan in forms of art, artifacts, relics, coin, documents and Quranic scriptures in its 11 different galleries. Art pieces showcased in the museum come from the ancient Indus Valley Civilization, the Gandhara Civilization and the Islamic Golden Age, which include miniature paintings.</p>\r\n<p>Next, head to the State Bank Museum, which the most prominent money museum in the country with seven galleries displaying various ancient and contemporary currencies, coins, stamps and art. The building that holds the museum is a work of art with its colonial era design constructed in the 1920s in pink stone. From bartering to our current economic system, there is information available on all things money. You&rsquo;ll also find some beautiful works of art by Pakistan&rsquo;s most celebrated and incredible artist, Sadequain.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/4.jpg\" alt=\"\" width=\"1024\" height=\"768\" /></p>\r\n<p>Evening</p>\r\n<p>If you are in the mood, you can enjoy a cup of refreshing chai on the way to your next destination at one of the many roadside dhabas, which you will encounter on the way. Alternatively, you might be hungry after all those museum visits. Stop by at Chai Wala&lsquo;s Clifton branch for some delicious Pakistani snacks, like paratha, with various stuffings, chai and finger food. The dhaba is colourfully decorated and is definitely a vibrant place to witness an important element of Pakistani culture.</p>\r\n<p>Chai Wala&lsquo;s Clifton branch, Karachi</p>\r\n<p>A short drive away is the beautiful Mohatta Palace, which is a monument, an art gallery and a spectacle of majestic Rajasthani architecture. It was built in 1927 for a Hindu Prince and has now been transformed into an art gallery whose sections hold different sculptures and exhibitions that showcase the culture of Pakistan and its socio-political history. The beautiful building is accompanied by luscious green lawns and age-old trees, which are the perfect place to unwind after a busy day and watch the day turn to night.</p>\r\n<p>Silver Plate with enamel inclay c, 18thth century, attributed to Kashmir</p>\r\n<p>After visiting the Mohatta Palace, head towards Port Grand, which is a seaside establishment next to the Port of Karachi featuring numerous eateries and other entertainment options like fire shows, boating and musical and performance art shows. If you are interested in ships and docks, then this is an excellent place to check out as it&rsquo;s surrounded by ships of all sizes that stop at the port. There are local, continental, Arabic and Western food options for dinner. Some of the best include Pakistan&rsquo;s own OPTP for the most delicious french fries with a spicy and garlic sauce.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/8.jpg\" alt=\"\" width=\"800\" height=\"800\" /></p>\r\n<p>Day 2</p>\r\n<p>Morning</p>\r\n<p>Start your morning with a hearty Pakistani-style breakfast with aloo, chana, halwa, poori and chai, also known simply as halwa puri, at Boat Basin&rsquo;s Dera Dhaba. Once you&rsquo;re done, hop over to Frere Hall to step into the 1860s when the building, which was supposed to serve as a Town Hall, was first created. Gaze at the facade&rsquo;s Victorian-Gothic style of design and then, head indoors to admire Sadequain&rsquo;s mesmerizing rooftop mural. The abstract yet clearly symbolic work of this painter is recognized world over and is not to be missed.</p>\r\n<p>Next, walk five minutes to the closeby Flagstaff House, also known as the Quaid-e-Azam Museum. The house serves as a museum revealing the social and political life of the nation&rsquo;s founding father, Quaid-e-Azam, with many vintage era personal belongings and furnishings that are unique and fascinating. The structure itself is also very interesting, being Victorian but residential, hence sporting interesting balconies and foyers.</p>\r\n<p>Afternoon</p>\r\n<p>There are plenty of shopping spots in Karachi, given its massive size and diversity, but no other place specializes in local crafts and items like Zainab Market on Zaibunnisa Street. Head over to this narrow alley based bazaar to discover ethnic treasures from all over Pakistan like gemstone jewellery extracted from the northern hills, Pashmina shawls from Kashmir and metal jewellery from the southern plateaus. You will find ample amounts of beautiful souvenirs to take home for family and friends. Outside the bazaar, you will find many street vendors selling yummy street food and drinks like lemon soda, fresh sugar cane juice, bun kebabs and the must-try sev puri with masala.</p>\r\n<p>Your next stop is Zahid Nihari for lunch on nearby Mansfield Street, a restaurant that serves Pakistan&rsquo;s decadent national dish called nihari, which is a slightly spicy flavourful meat stew eaten with naan bread.</p>\r\n<p>Evening</p>\r\n<p>Next, walk to Saint Patrick&rsquo;s Cathedral at Shahrah-e-Iraq. This intricately striking Cathedral was built in the style of Gothic Revival architecture. Its interiors are lavish, warm and inviting with colourful stained glass windows and wooden furnishings.</p>\r\n<p>Then, make your way towards Quaid&rsquo;s Mausoleum to admire Karachi&rsquo;s most popular monument. The building was inspired by the Samanid Mosque in Uzbekistan but in a more minimal style with its facade laid in pure white marble. On the inside, there is an extravagant chandelier on the roof right above the underground tomb, which was gifted to Pakistan by the Chinese government as a gesture of friendship and alliance.</p>\r\n<p>Night</p>\r\n<p>Visit the shrine of Abdullah Shah Ghazi if you fancy witnessing the atmosphere at the tomb of Pakistan&rsquo;s most respected and loved Sufi saint and poet, where hundreds of people go on a daily basis to pay their respects. You will find people from all walks of life here, arriving with flower garlands, petals and printed fabrics placed on top of the tomb&rsquo;s grave. Music is often played or made with devotional drum hitting, often accompanied by singing or recitals of the of many famous poems written by the saint.</p>\r\n<p>Ambrosia Fine Dining</p>\r\n<p>Finally, recluse for dinner in the serene spacious gardens or the exquisitely furnished interiors of Ambrosia Restaurant on Hatim Alvi Road. Specializing in Mediterranean cuisine, this fine-dining restaurant is sure to awaken your senses and satisfy your taste buds.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/9.jpg\" alt=\"\" width=\"1024\" height=\"681\" /></p>', 'how-to-spend-2-days-in-karachi', 'publish', 3, 720, 1, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 12:43:29'),
(7, 'Top 6 Tourist Attractions Near Islamabad', '<p>Pakistan&rsquo;s capital, Islamabad, is the gateway to the famed northern areas of Pakistan, where both locals and visitors like to unwind over the weekend.</p>\r\n<p>Life in Islamabad is more sedate than the faster-paced cities of Lahore and Karachi. It is younger than its centuries-old counterparts, covers less area and has a relatively smaller population. Sometimes, the drudgery of everyday routine can sneak up on you. Luckily, when that happens, you can find yourself in a completely new setting in just a few hours, enjoying stunning views while enjoying a hot cup of chai.</p>\r\n<p>1: Nathia Gali</p>\r\n<p>2: Murree</p>\r\n<p>3: Thandiani</p>\r\n<p>4: Siri Paye Meadows</p>\r\n<p>5: Naran</p>\r\n<p>6: Neelum Valley, Azad Kashmir</p>\r\n<p>1: Nathia Gali</p>\r\n<p>The green mountain resort of Nathia Gali, approximately 2,410 metres above sea level, is a popular choice for a mini vacation. Plant life is abundant, so you will find meadows and plenty of pine, cedar, walnut, oak and maple trees. Those who want a more adventurous excursion can trek up the Mukshpuri (also Mukeshpuri) and Miranjani hills, which peak at 2,800 and 2,992 metres respectively.</p>\r\n<p>How to get there:</p>\r\n<p>Nathia Gali is roughly a 2.5-hour drive from Islamabad. You can hire private transportation or hop on a Daewoo Express bus that runs every few hours from Rawalpindi (Islamabad&rsquo;s twin city) to Murree. Once in Murree, you will find plenty of public transport options to take you to Nathia Gali.</p>\r\n<p>Where to stay:</p>\r\n<p>Frequent visitors opt for either Hotel Amore or Hotel Elites. The rooms, meals, and other features in these hotels are generally better rated than many other options available in the vicinity.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/5-shutterstock-686212990-1024x6851.jpg\" alt=\"\" width=\"1024\" height=\"685\" /></p>\r\n<p>2: Murree</p>\r\n<p>For years and years, Murree &ndash; a sanatorium for British troops in the mid-1800s and early 1900s &ndash; has been the go-to hill station for people from all over the country. Cooler temperatures in the summer and snowfall in the winter attract visitors all year round. While the novelty of the place has worn off considerably due to increasing commercialisation, Murree is still thronged by tourists as a transit station for longer journeys or a short stay in the quieter days of the year.</p>\r\n<p>How to get there:</p>\r\n<p>Just like Nathia Gali, you can get to Murree by car or bus (preferably Daewoo Express). You can choose from four routes; the quickest one is the Murree Expressway, via which you can be at your destination in under 1.5 hours</p>\r\n<p>Where to stay:</p>\r\n<p>Arcadian Blue Pines Resort, located just outside Murree, is a sensible choice for those who wish to avoid the busy roads and the noise of the town. A more luxurious option is Hotel One, and if you wish to have the Pearl Continental experience, PC Bhurban (close to Murree) is the place to stay.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/the-snowy-pipe-line-track.jpg\" alt=\"\" width=\"1200\" height=\"900\" /></p>\r\n<p>3: Thandiani</p>\r\n<p>For those looking to spend their weekend in a tranquil retreat that provides respite from the sweltering heat, Thandiani is a top pick. The hill station, located in the foothills of the Himalayas at about 2,750 metres above sea level, is the perfect getaway if you&rsquo;re willing to forego luxurious accommodation in favour of a calm environment and stunning surroundings.</p>\r\n<p>How to get there:</p>\r\n<p>Visitors usually prefer to travel in their own car, or rent a private vehicle from Islamabad, for the 3.5-hour drive via the Hazara Expressway. The usual itinerary includes a lunch break in the city of Abbottabad before reaching Thandiani</p>\r\n<p>Where to stay:</p>\r\n<p>You can book your room at the Forest Rest House Thandiani, which is managed by the Galiyat Development Authority under the auspices of the Government of Khyber Pakhtunkhwa.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/7970b9688f982e5fa2389cafda2930b1.jpg\" alt=\"\" width=\"362\" height=\"483\" /></p>\r\n<p>4: Siri Paye Meadows</p>\r\n<p>Lush green meadows at an elevation of 3,000 metres flanked by snow-capped mountain peaks, dotted with cattle under the watchful gaze of herdsmen, and adorned with a brilliant blue lake &ndash; this rustic wonder is called the Siri Paye Meadows. Because of the absence of a proper road leading up to it, this picturesque spot is relatively untouched. Adventure enthusiasts agree that in the summertime, the meadows offer a great camping experience.</p>\r\n<p>How to get there:</p>\r\n<p>Travellers coming from Islamabad will need to brave the five-hour drive via the Hazara Expressway or the N-35 to Shogran, from where jeeps can be rented to complete the remaining six-kilometre journey up a rough track.</p>\r\n<p>Where to stay:</p>\r\n<p>If camping is not your cup of tea, make your way down to Shogran to spend the night in more conventional lodgings. Visitors recommend Pine Park Shogran and the Arcadian Sprucewoods Resort for a comfortable stay.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/banjosa-lakepinterestcom-edited.jpg\" alt=\"\" width=\"1024\" height=\"576\" /></p>\r\n<p>5: Naran</p>\r\n<p>Despite gradually becoming overwhelmed with tourists and traffic (much like Murree), Naran remains a popular choice for a weekend getaway, mainly because of the magnificent Lake Saif-ul-Malook, River Kunhar&rsquo;s delicious trout, rafting opportunities, camping by the riverside and hiking or trekking up different tracks. The town is situated in the Kaghan Valley and is around 2,400 metres above sea level.</p>\r\n<p>How to get there:</p>\r\n<p>The same road that leads to Shogran from Islamabad continues onward to Naran. Although public transportation is available, travelling by private car is preferred so that you don&rsquo;t have to keep rushing from one public vehicle to another in order to eventually reach Naran.</p>\r\n<p>Where to stay:</p>\r\n<p>Maisonette Hotels &amp; Resorts offer high-end options in Naran, while Hotel Demanchi is more affordable. The PTDC Motel Naran is a government-owned accommodation consisting of standard rooms as well as private huts.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/badshahimosque-4792462-19202.jpg\" alt=\"\" width=\"1024\" height=\"683\" /></p>\r\n<p>6: Neelum Valley, Azad Kashmir</p>\r\n<p>To the north of Pakistan, at a distance of about 250 kilometres from Islamabad, lies Neelum Valley in Azad Kashmir. In the last few years, the valley has gained repute as another major option for a long-weekend vacation in the mountains, with the added attraction of the fast flowing River Neelum. The destination is especially appealing to those who genuinely wish to disconnect from the world, as there is little to no cellular network coverage there. Foreigners require a No-Objection Certificate (NOC) from the Pakistani government to visit Neelum Valley.</p>\r\n<p>How to get there:</p>\r\n<p>From Murree, the first stop on the way to Neelum Valley is Muzaffarabad, which can be reached via the Murree-Kohala road. From there it&rsquo;s a 3.5-hour drive to the valley, for which private transport is highly recommended.</p>\r\n<p>Where to stay:</p>\r\n<p>Neelum Valley has plenty of villages and towns to visit, depending on time availability and personal preferences. Keran Guest House is the best option to stay in the Keran village if you want to be by the river. Alternatively, the Kutton Jagran Resort has French cottages that were originally constructed for Europeans who worked on the Jagran Hydropower Project around two decades ago.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/de.jpg\" alt=\"\" width=\"720\" height=\"480\" /></p>', 'top-6-tourist-attractions-near-islamabad', 'publish', 5, 713, 1, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 12:43:44'),
(8, 'Lahore Tourist Guide', '<p>Tourists have always been enthralled by Lahore, the cultural centre of Pakistan, for its extensive history, culture, and cuisine. On a Lahore tour, tourists may experience the city&rsquo;s Mughal-era architecture, lovely gardens, and bazaars full of ethnic goods and spices, to name just a few highlights. In this post, we&rsquo;ll look more closely at some of the essential components of a tour of Lahore, such as its history, cultural legacy, food, and well-known tourist attractions.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/things-to-do-in-lahore2.jpg\" alt=\"\" width=\"1920\" height=\"901\" /></p>\r\n<p>The city has a more than a thousand-year history, during which time it has been governed by several dynasties, including the Mughals, Sikhs, and British. Beautiful structures that showcase the Mughal era include the Lahore Fort, Badshahi Mosque, and Shalimar Gardens. The city&rsquo;s architecture is a reflection of its history. For anyone interested in learning more about Pakistan&rsquo;s rich cultural legacy, these historical landmarks are must-see locations.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/pexels-salman-kazmi-12912453-1024x6821.jpg\" alt=\"\" width=\"1024\" height=\"682\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>The Sheesh Mahal, Naulakha Pavilion, and Diwan-i-Aam are just a few of the beautiful buildings that can be found inside the Lahore Fort, also known as Shahi Qila, which is a UNESCO World Heritage Site. One of the largest mosques in the world, the Badshahi Mosque is known for its exquisite marble domes and complex carvings. It is situated across from the Lahore Fort. The Shalimar Gardens, which the Mughal emperor Shah Jahan constructed, are the epitome of Mughal landscape architecture.</p>\r\n<p>&nbsp;</p>\r\n<p>The city is renowned for its culture and customs in addition to its historical sites. For ages, the city has been a centre for the arts, literature, and music, and it has given birth to numerous accomplished musicians and writers. By visiting locations like the Lahore Museum, which has a sizable collection of artwork, antiquities, and manuscripts from various centuries, visitors to Lahore can learn more about the city&rsquo;s cultural legacy.</p>\r\n<p>The Sikh era and the history and culture of the Sikh people are both highlighted in a part of the Lahore Museum. The Wagah Border Ceremony, a daily military ceremonial that takes place at the border between Pakistan and India, is another well-liked cultural event in Lahore. For anybody visiting the city, the ritual is a must-see as it is a manifestation of patriotism.</p>\r\n<p>A visit to Lahore would be incomplete without sampling some of the local cuisine. Lahore is well known for its rich and spicily prepared food, which combines traditional Pakistani and Mughlai fare. A vast variety of street foods, including fried fish and spicy kebabs, as well as classic dishes like haleem and biryani are available at the city&rsquo;s bazaars, especially the renowned Anarkali bazaar.</p>\r\n<p>Indian, Persian, and Afghan cuisines have all had an impact on the cuisine in Lahore, which reflects the city&rsquo;s varied background in its cuisine. Moreover, typical Pakistani desserts like gulab jamun and jalebi, which are sweet and syrupy treats sure to satiate any sweet craving, are available for tourists to experience in Lahore.</p>\r\n<p>The Lahore Zoo, Lahore Safari Park, and the Lahore Bird Sanctuary are just a few of the several additional well-known tourist destinations that can be found in Lahore. With a variety of creatures on display, including lions, tigers, elephants, and monkeys, the Lahore Zoo, situated in the centre of the city, is a great location for families and animal enthusiasts. A major wildlife park outside of the city, the Lahore Safari Park is home to several exotic creatures like zebras, giraffes, and rhinos. With more than 150 species of birds on exhibit, the Lahore Bird Sanctuary is a natural reserve next to the Lahore Canal that attracts many birdwatchers.</p>\r\n<p><img src=\"/uploads/0000/1/2023/07/15/pexels-shahbaz-hussain-shah-4610272-1024x6451.jpg\" alt=\"\" width=\"1024\" height=\"645\" /></p>', 'lahore-tourist-guide', 'publish', 5, 701, 1, 1, NULL, NULL, NULL, '2023-06-24 00:07:46', '2023-07-15 12:39:39');
