(1, 'System Admin', 'System', 'Admin', 'admin@paktourismhub.com', '2023-06-24 00:07:41', '$2y$10$lY3Zpib3iCai.VfiPOk80eduerP1cHfY499Pfz0pqIh0rpvp5Z2mC', NULL, NULL, NULL, NULL, '112 666 888', '1970-01-01', 'New York', NULL, 'PK', NULL, NULL, 227, '<p>We\'re designers who have fallen in love with creating spaces for others to reflect, reset, and create. We split our time between two deserts (the Mojave, and the Sonoran). We love the way the heat sinks into our bones, the vibrant sunsets, and the wildlife we get to call our neighbors.</p>', 'publish', NULL, NULL, NULL, NULL, NULL, 'sHWKqyHCnMWR09Uw8sX4JMoz09E5g3aqVL3i8YDOm6x65P7k0roUxs8B7nyl', '2023-06-24 00:07:41', '2023-06-24 06:57:05', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '#2180f3', NULL, NULL, 'Admin'),
(2, 'Royal Palace', 'Royal', 'Palace', 'royal@paktourismhub.com', '2023-06-24 00:07:42', '$2y$10$qhkh9ovDnD/w0X9jtG95l.FHSUVqxX3WnbfcS/jk/Bs/PWFcSj8hC', NULL, NULL, NULL, NULL, '112 666 888', '1970-01-01', 'Narran Kaghan', NULL, 'PK', NULL, NULL, NULL, '<p>Step into a world of regal opulence with Royal Palace, a distinguished hoteling vendor. Immerse yourself in the grandeur of their luxurious accommodations adorned with exquisite decor and elegant furnishings. Experience impeccable service fit for royalty, where every need is anticipated and exceeded. Indulge in culinary delights at their fine dining restaurants, and unwind in lavish spa facilities. Discover a truly majestic retreat at Royal Palace, where luxury meets sophistication to create an unforgettable stay.</p>', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-06-24 00:07:42', '2023-07-16 09:55:21', NULL, NULL, NULL, 'The Royal Place', NULL, NULL, 0, 0, '#2180f3', NULL, NULL, 'Royal_Palace'),
(3, 'Adeel Gulzar', 'Adeel', 'Gulzar', 'adeel.bsit466@iiu.edu.pk', '2023-06-24 00:07:42', '$2y$10$.977dhgI9g7FD9IQC0lsnOCJtcmwxX10sPweCHpFW6h.iaJ.GsFXe', NULL, NULL, NULL, NULL, '112 666 888', '1970-01-01', 'Rawlakot', NULL, 'PK', NULL, NULL, 757, '', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-06-24 00:07:42', '2023-07-16 09:58:53', NULL, NULL, NULL, 'Adeel Gulzar', NULL, NULL, 0, 0, '#2180f3', NULL, NULL, 'Adeel'),
(4, 'Grand Luxe', 'Grand', 'Luxe', 'grand@paktourismhub.com', '2023-06-24 00:07:42', '$2y$10$01V0fCwKEQeYN328VvYGzeLCKU2Uyn5PZxoAPBRz0scUv0pxUqqaq', NULL, NULL, NULL, NULL, '112 666 888', '1970-01-01', 'Chitral', NULL, 'PK', NULL, NULL, NULL, '<p>Grand Luxe, a premier hotel vendor, offers an unparalleled luxury experience that surpasses expectations. Immerse yourself in opulence and sophistication at their meticulously designed accommodations. Indulge in world-class amenities, exceptional service, and breathtaking views that redefine the meaning of grandeur. Whether for a leisurely escape or a lavish event, Grand Luxe sets the stage for unforgettable memories. Elevate your stay to new heights of elegance with Grand Luxe, where every moment is an extraordinary celebration of luxury.</p>', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-06-24 00:07:42', '2023-07-16 09:53:25', NULL, NULL, NULL, 'Grand Luxe', NULL, NULL, 0, 0, '#2180f3', NULL, NULL, 'Grand_Luxe'),
(5, '4WD Tour', '4WD', 'Tour', '4wd@paktourismhub.com', '2023-06-24 00:07:42', '$2y$10$eNN/6jDIP9Tigs5D/981KO3Mh..S5WYS4BTe21qjCzCcjphkkhF5K', NULL, NULL, NULL, NULL, '112 666 888', '1970-01-01', 'Rawalpindi', NULL, 'US', NULL, NULL, NULL, '<p>4WD Tour Planners is your ultimate adventure companion, specializing in off-road expeditions to remote and thrilling destinations. From rugged terrains to hidden gems, we curate unforgettable experiences for adrenaline enthusiasts. Let our expert guides navigate the unexplored, as you embark on thrilling 4WD journeys that push boundaries. With safety as our top priority, we ensure a seamless and exhilarating exploration of untamed landscapes. Get ready to unleash your adventurous spirit with 4WD Tour Planners and create memories that will fuel your wanderlust for years to come.</p>', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-06-24 00:07:42', '2023-07-16 10:07:50', NULL, NULL, NULL, '4WD Tour Planner', NULL, NULL, 0, 0, '#2180f3', NULL, NULL, '4WD_Tour'),
(6, 'Lynne Victoria', 'Lynne', 'Victoria', 'Victoria@bookingcore.test_d_64b18549e422446477', '2023-06-24 00:07:42', '$2y$10$yjbYzTLjKz/KMcSsDtUitO9K825gE2O0GtCy1e24jdn7zePB4B6ly', NULL, NULL, NULL, NULL, '112 666 888', NULL, 'New York', NULL, 'US', NULL, NULL, NULL, 'We\'re designers who have fallen in love with creating spaces for others to reflect, reset, and create. We split our time between two deserts (the Mojave, and the Sonoran). We love the way the heat sinks into our bones, the vibrant sunsets, and the wildlife we get to call our neighbors.', 'publish', NULL, NULL, NULL, NULL, '2023-07-14 17:26:33', NULL, '2023-06-24 00:07:42', '2023-07-14 17:26:33', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '#2180f3', NULL, NULL, NULL),
(7, 'Heaven Tour Planner', 'Heaven', 'Tour Planner', 'heaventp@paktourismhub.com', NULL, '$2y$10$T54lCOBZcXJfO9kRrE2UpOOkHYxVlqV/3by1OnZ9B8StZnaIUTvpC', NULL, NULL, NULL, NULL, '888 999 777', '1970-01-01', 'Rawalpindi', NULL, 'PK', NULL, NULL, NULL, '<p>Heaven Tour Planners is your gateway to unforgettable travel experiences. With expert guidance and meticulous planning, we curate dream vacations tailored to your desires. Explore breathtaking destinations, immerse yourself in diverse cultures, and create memories that last a lifetime. Trust Heaven Tour Planners to handle all the details, ensuring a seamless journey from start to finish. Embark on a personalized tour that takes you to heavenly destinations, leaving you with a sense of awe and wonder.</p>', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-06-24 00:07:42', '2023-07-16 09:49:10', NULL, NULL, NULL, 'Heaven Tour Planners', NULL, NULL, 0, 0, '#2180f3', NULL, NULL, 'Heaventp'),
(8, 'Sarah Violet', 'Sarah', 'Violet', 'Violet@bookingcore.test_d_64b18549e1cce55600', NULL, '$2y$10$Sw8WD7QgfmZk3cu6/.jhzu3obKexm9UQ29ljypD7ETHc.4o49cyIW', NULL, NULL, NULL, NULL, '888 999 777', NULL, 'New York', NULL, 'US', NULL, NULL, NULL, 'We\'re designers who have fallen in love with creating spaces for others to reflect, reset, and create. We split our time between two deserts (the Mojave, and the Sonoran). We love the way the heat sinks into our bones, the vibrant sunsets, and the wildlife we get to call our neighbors.', 'publish', NULL, NULL, NULL, NULL, '2023-07-14 17:26:33', NULL, '2023-06-24 00:07:42', '2023-07-14 17:26:33', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '#2180f3', NULL, NULL, NULL),
