(11, 'Shushi Yashashree', 'Shushi', 'Yashashree', 'Yashashree@bookingcore.test_d_64b18549d929361540', NULL, '$2y$10$2UYswU7VKptjnp1f0A0tVOPIJ/rqIIpYE8sxvrqql62szpfgJWL5a', NULL, NULL, NULL, NULL, '888 999 777', NULL, 'New York', NULL, 'US', NULL, NULL, NULL, 'We\'re designers who have fallen in love with creating spaces for others to reflect, reset, and create. We split our time between two deserts (the Mojave, and the Sonoran). We love the way the heat sinks into our bones, the vibrant sunsets, and the wildlife we get to call our neighbors.', 'publish', NULL, NULL, NULL, NULL, '2023-07-14 17:26:33', NULL, '2023-06-24 00:07:42', '2023-07-14 17:26:33', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '#2180f3', NULL, NULL, NULL),
(12, 'Anne Nami', 'Anne', 'Nami', 'Nami@bookingcore.test_d_64b18549d566c95180', NULL, '$2y$10$gp2yY5yNt8WUe3DQRkFDlOW441SeiDZqk1YlbOySyQ7zH/nZepN62', NULL, NULL, NULL, NULL, '888 999 777', NULL, 'New York', NULL, 'US', NULL, NULL, NULL, 'We\'re designers who have fallen in love with creating spaces for others to reflect, reset, and create. We split our time between two deserts (the Mojave, and the Sonoran). We love the way the heat sinks into our bones, the vibrant sunsets, and the wildlife we get to call our neighbors.', 'publish', NULL, NULL, NULL, NULL, '2023-07-14 17:26:33', NULL, '2023-06-24 00:07:42', '2023-07-14 17:26:33', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '#2180f3', NULL, NULL, NULL),
(13, 'Comfortable Spaces', 'Comfortable', 'Spaces', 'Comfyspaces@paktourismhub.com', NULL, '$2y$10$QmjO87IXtBnmMV.dvOSG5.XaJMeEValwzI7qb834uEg/DZEVGxpdW', NULL, NULL, NULL, NULL, '0518962532', '1970-01-01', 'Nathiagali', NULL, 'PK', NULL, NULL, NULL, '<p>Step into a world of comfort and serenity with Comfortable Spaces, your premier space vendor for unforgettable experiences. Discover meticulously designed venues that seamlessly blend elegance, functionality, and a welcoming ambiance. From stylish event spaces to cozy meeting rooms, Comfortable Spaces offers versatile options to cater to your specific needs. With their attention to detail and exceptional service, they ensure every event is a resounding success. Trust Comfortable Spaces to provide you with the perfect setting for memorable gatherings and remarkable moments.</p>', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-06-24 00:07:42', '2023-07-14 17:25:19', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '#2180f3', NULL, NULL, 'Comfortable-Spaces'),
(14, 'Norah car rentals', 'Norah', 'car rentals', 'Norah@paktourismhub.com', NULL, '$2y$10$aaI/1QdRmbvYN1UdhC3m9e67Vg/mQ6vZZdy33Or5COsGwUdTgedTG', NULL, NULL, NULL, NULL, '0519834761', '1970-01-01', 'Lahore', NULL, 'US', NULL, NULL, NULL, '<p>Experience seamless travel with Norah Car Rentals, your go-to destination for reliable and convenient car rentals. With a diverse fleet of well-maintained vehicles, they offer options to suit every preference and budget. From compact cars to spacious SUVs, Norah Car Rentals ensures a comfortable and hassle-free journey. Their exceptional customer service and competitive rates make them the trusted choice for all your transportation needs. Whether for business or leisure, trust Norah Car Rentals to provide you with a smooth and enjoyable driving experience.</p>', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-06-24 00:07:42', '2023-07-14 17:20:55', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '#2180f3', NULL, NULL, 'Norah-carRentals'),
(15, 'Luxuary Singles', 'Luxuary', 'Singles', 'luxuary@paktourismhub.com', NULL, '$2y$10$F0fOyK9J6MaObYvmplGkNu1v3uD2RWOZquxwwQOo.psLJUJhPAUgS', NULL, NULL, NULL, NULL, '051668237921', '1970-01-01', 'Hunza', NULL, 'PK', NULL, NULL, NULL, '<p>Escape to the epitome of luxury and tranquility with Luxuary Singles Resort. Nestled in breathtaking surroundings, their resort offers a haven of relaxation and indulgence. Immerse yourself in opulent accommodations, world-class amenities, and impeccable service that caters to your every need. From rejuvenating spa treatments to exquisite dining experiences, Luxuary Singles Resort ensures a truly unforgettable stay. Unwind in style and experience a retreat like no other at this exclusive resort destination.</p>', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-06-24 00:07:43', '2023-07-16 09:43:38', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '#2180f3', NULL, NULL, 'Luxuary-Singles'),
(16, 'Aliyan Travels', 'Aliyan', 'Travels', 'aliyan-travels@paktourismhub.com', NULL, '$2y$10$uzLUt6eNrOcLA/fQWgIJY.wAnIqG1gdwhlbXWj9d284ejVbToBoeq', NULL, NULL, NULL, NULL, '03185669820', '1970-01-01', 'Islamabad', NULL, 'PK', NULL, NULL, NULL, '<p>Embark on extraordinary adventures with Aliyan Travels, your gateway to remarkable travel experiences. With a passion for exploration, they offer personalized itineraries that cater to your unique preferences and ensure every moment is filled with awe-inspiring memories. From expertly guided tours to seamless logistics, Aliyan Travels goes above and beyond to deliver exceptional service and create unforgettable journeys. With a commitment to customer satisfaction, their attention to detail and dedication will make your travel dreams a reality. Trust Aliyan Travels to unlock this country\'s wonders and make your travel dreams come true.</p>', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-06-24 00:07:43', '2023-07-14 17:32:53', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '#2180f3', NULL, NULL, 'Aliyan-Travels'),
(18, 'Faiz Mir', 'Faiz', 'Mir', 'faiz@paktourismhub.com', NULL, '$2y$10$OVCB6qG9aX9/EVGmCAGwee0It0q3uN7sUMlHTt2vFZzlkaW6QiJ7u', NULL, NULL, NULL, NULL, '0300000000', '1970-01-01', 'Rawlakot', 'AJK', 'PK', 56000, NULL, NULL, '', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-06-25 16:08:12', '2023-07-12 11:44:46', NULL, NULL, NULL, 'Faiz Rental Service', 'completed', 1, 0, 0, '#2180f3', NULL, NULL, 'Faiz_Mir'),
(19, 'Ahmed Saleem', 'Ahmed', 'Saleem', 'muhmmad.bsit472@iiu.edu.pk', NULL, '$2y$10$tk4QIaFesFxyJKpnldT5z.9mmChOv1wOUaB/VFhbTLOmW04nbso3m', NULL, NULL, 'House BI_1098-E st# 5 Sadiqabad muslim town rwp', NULL, '03055014140', '1970-01-01', 'rawalpindi', NULL, 'PK', 46000, NULL, 758, '', 'publish', NULL, NULL, NULL, NULL, NULL, NULL, '2023-07-16 09:59:38', '2023-07-16 10:04:53', NULL, NULL, NULL, 'Ahmed Saleem', NULL, NULL, 0, 0, '#2180f3', NULL, NULL, 'Ahmed');
